INSERT INTO `faqs` VALUES (1,'Cordy-x','TS','Dược','Sản phẩm này có tác dụng gì?','<p>Dạ thưa anh/chị, sản phẩm Cao Nấm Tr&ugrave;ng Thảo Cordy &ndash; X c&oacute; t&aacute;c dụng:<br />-&nbsp; &nbsp;Gi&uacute;p hỗ trợ bồi bổ sức khoẻ, tăng cường sức đề kh&aacute;ng cho cơ thể.<br />-&nbsp; &nbsp;C&acirc;n bằng cuộc sống, cải thiện t&igrave;nh trạng mất ngủ v&agrave; suy nhược cơ thể.<br />-&nbsp; &nbsp;Thanh lọc cơ thể, gi&uacute;p trẻ ho&aacute; từ b&ecirc;n trong.</p>','faqs/April2019/Ux36tzWtqdiAtKmxSoVj.png',NULL,'2019-06-27 00:14:09',NULL,5),(2,'Đông trùng Hạ Thảo','Dai Hoc UISAN Han Quoc','GS TS Nghien Cuu & Thuc Nghiem','Người nhà mới mổ xong, có dùng sản phẩm được hay không? Vì tôi được biết Đông Trùng Hạ Thảo không dùng cho người đang chảy máu?','<p class=\"MsoNormal\">Dạ thưa anh/chị, sản phẩm Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; sự kết hợp tinh chất chiết xuất Nấm Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo v&agrave; Nấm Linh Chi với c&ocirc;ng dụng ch&iacute;nh l&agrave; phục hồi v&agrave; bồi bổ sức khoẻ, tăng sức đề kh&aacute;ng cho bệnh nhận sau điều trị bệnh, sau mổ, sau ho&aacute; xạ trị n&ecirc;n sản phẩm l&agrave; lựa chọn tối ưu để chăm lo sức khoẻ người th&acirc;n. Tuy nhi&ecirc;n kh&ocirc;ng d&ugrave;ng sản phẩm trong trường hợp c&oacute; vết thương hở đang chảy m&aacute;u, nếu người nh&agrave; anh/chị sau ca mổ đ&atilde; cầm được m&aacute;u, đang l&agrave;m l&agrave;nh lại vết thương, l&uacute;c n&agrave;y cơ thể suy yếu v&agrave; cần sự phục hồi th&igrave; c&oacute; thể d&ugrave;ng sản phẩm. Tuy nhi&ecirc;n anh/chị n&ecirc;n tham khảo th&ecirc;m &yacute; kiến b&aacute;c sĩ đang điều trị cho người nh&agrave; ạ.</p>','faqs/April2019/v9YkSbFGbL6oIBqdTpDV.png',NULL,'2019-06-27 00:27:12',NULL,8),(3,'Cao nấm','Tiến Sĩ','Dược','Tôi thấy sản phẩm có mật ong và maltose nhưng Tôi bị đái tháo đường, vậy có dùng sản phẩm được hay không?','<p class=\"MsoNormal\">Dạ thưa anh/chị, sản phẩm Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; sự kết hợp tinh chất chiết xuất Nấm Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo v&agrave; Nấm Linh Chi, mỗi loại dược liệu đều c&oacute; chức năng điều ho&agrave; đường huyết. Tuy trong sản phẩm c&oacute; đường v&agrave; mật ong nhưng tải trọng đường cho mỗi lần d&ugrave;ng chỉ tương đương nửa muỗng caf&eacute; cơm trắng, rất &iacute;t so với bữa ăn h&agrave;ng ng&agrave;y n&ecirc;n B&aacute;c c&oacute; thể y&ecirc;n t&acirc;m d&ugrave;ng sản phẩm ạ.</p>','faqs/March2019/UehXJa3hRQziwLI57kO5.png',NULL,'2019-06-25 19:24:14',NULL,5),(4,'MHD','TS','Dược','Sản phẩm này dùng thời điểm nào trong ngày là tốt nhất?','<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: Arial; mso-fareast-font-family: 等线; font-size: 11.0000pt;\">Dạ thưa anh/chị, sản phẩm Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; sự kết hợp tinh chất chiết xuất Nấm Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo v&agrave; Nấm Linh Chi với c&ocirc;ng dụng ch&iacute;nh l&agrave; phục hồi v&agrave; bồi bổ sức khoẻ, tăng sức đề kh&aacute;ng cho bệnh nhận. Thời gian sử dụng tốt nhất trong ng&agrave;y l&agrave; trước bữa ăn s&aacute;ng 30 ph&uacute;t. Trong trường hợp muốn cải thiện giấc ngủ s&acirc;u c&oacute; thể d&ugrave;ng l&uacute;c 17h chiều ạ.</span></p>','faqs/April2019/FUwULafshss1sCzeiVWR.png',NULL,'2019-06-25 00:32:40',NULL,7),(5,'MHD','TS','Dược','Trên thị trường có rất nhiều sản phẩm có Đông Trùng Hạ Thảo, vây sản phẩm này khác gì những sản phẩm còn lại?','<p>Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; sản phẩm được nghi&ecirc;n cứu &amp; ph&aacute;t triển, chuyển giao c&ocirc;ng nghệ từ Đại Học Thủ Dầu Một. Sản phẩm l&agrave; Cao Đặc chứa tinh chất Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo v&agrave; tinh chất Nấm Linh Chi. V&agrave; để đảm bảo sản phẩm c&oacute; được h&agrave;m lượng dược chất cao nhất, c&aacute;c nh&agrave; khoa học đ&atilde; rất ch&uacute; trọng đến từng giai đoạn trong qu&aacute; tr&igrave;nh ph&aacute;t triển v&agrave; h&igrave;nh th&agrave;nh n&ecirc;n Cordy - X:<br /><strong>-&nbsp; CON GIỐNG:</strong>&nbsp;Được nhập khẩu từ ATCC - Ng&acirc;n h&agrave;ng giống Hoa Kỳ uy t&iacute;n nhất thế giới.<br /><strong>-&nbsp; M&Ocirc;I TRƯỜNG NU&Ocirc;I TRỒNG:</strong>&nbsp;Thiết lập m&ocirc;i tường nu&ocirc;i trồng v&ocirc; tr&ugrave;ng, tu&acirc;n thủ nghi&ecirc;m ngặt c&aacute;c ti&ecirc;u ch&iacute; về nhiệt độ, độ ẩm &amp; &aacute;nh s&aacute;ng th&ocirc;ng qua hệ thống gi&aacute;m s&aacute;t tự động (giống như m&ocirc;i trường sinh trưởng của Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo ngo&agrave;i tự nhi&ecirc;n).<br /><strong>-&nbsp; C&Ocirc;NG NGHỆ CHIẾT XUẤT NHIỆT LẠNH &amp; C&Ocirc; ĐẶC CH&Acirc;N KH&Ocirc;NG:<br /></strong>&nbsp; &nbsp; &nbsp;o&nbsp; Chỉ sử dụng Quả Thể c&ograve;n tươi để chiết xuất, tuyệt đối kh&ocirc;ng d&ugrave;ng cồn c&ocirc;ng nghiệp trong qu&aacute; tr&igrave;nh chiết xuất.<br />&nbsp; &nbsp; &nbsp;o&nbsp; D&acirc;y chuyền chiết xuất PH&Acirc;N TỬ hiện đại (từ H&agrave;n Quốc) gi&uacute;p Sản Phẩm c&oacute; độ h&ograve;a tan v&agrave; thẩm thấu nhanh.<br /><strong>-&nbsp; </strong>Cam kết kh&ocirc;ng d&ugrave;ng chất bảo quản, chất tạo m&agrave;u trong qu&aacute; tr&igrave;nh sản xuất.</p>','faqs/April2019/jRg8spFMsM1MXKw2YSjP.png',NULL,'2019-06-25 00:32:47',NULL,7),(6,'MHD','TS','Dược','Đông Trùng Hạ Thảo là sâu hay nấm? Nếu là sâu thì Bà Tôi ăn chay trường có dùng được sản phẩm này khồng vì có chứa Đông Trùng Hạ Thảo?','<p class=\"MsoNormal\">Dạ thưa anh/chị, Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo bản chất l&agrave; nấm kh&ocirc;ng phải s&acirc;u. Sở dĩ c&oacute; t&ecirc;n gọi Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo v&igrave; v&agrave;o m&ugrave;a đ&ocirc;ng, nấm k&yacute; sinh tr&ecirc;n lo&agrave;i s&acirc;u, sử dụng chất dinh dưỡng của s&acirc;u v&agrave; đến m&ugrave;a h&egrave; ph&aacute;t triển th&agrave;nh nấm (th&acirc;n thảo). Nguy&ecirc;n liệu sản xuất Cao Nấm Tr&ugrave;ng Thảo Cordy &ndash; X l&agrave; phần th&acirc;n thảo c&ograve;n tươi của loại nấm n&agrave;y n&ecirc;n anh/chị cứ y&ecirc;n t&acirc;m l&agrave; người ăn chay trường c&oacute; thể d&ugrave;ng được ạ.</p>','faqs/April2019/z0HjtdNWypz6EmXTLfhs.png',NULL,'2019-06-25 00:33:59',NULL,6);
