INSERT INTO `products` VALUES (3,'Cao Nấm Trùng Thảo CORDY - X',2,'Cao đặc, Hộp 1 hũ 50 g',NULL,'<p><strong>Th&agrave;nh phần:<br />&nbsp; &nbsp; &nbsp;-&nbsp; </strong>Mỗi lọ 50g chứa tinh chất chiết xuất.<br /><strong>&nbsp; &nbsp; &nbsp;-</strong>&nbsp; Nấm linh chi Ganoderma lucidum: 12.50g.<br /><strong>&nbsp; &nbsp; &nbsp;-&nbsp; </strong>Nấm tr&ugrave;ng thảo Cordyceps militaris: 1.25g.</p>\r\n<p><strong>C&ocirc;ng dụng:<br /></strong><strong>&nbsp; &nbsp; &nbsp;-</strong>&nbsp; Hỗ trợ phục hồi bồi bổ sức khoẻ v&agrave; tăng cường sức đề kh&aacute;ng.<br /><strong>&nbsp; &nbsp; &nbsp;-&nbsp; </strong>C&acirc;n bằng cơ thể, cải thiện giấc ngủ v&agrave; suy nhược cơ thể.<br /><strong>&nbsp; &nbsp; &nbsp;-&nbsp; </strong>Thanh lọc cơ thể, gi&uacute;p trẻ ho&aacute; từ b&ecirc;n trong.</p>\r\n<p><strong>Đối tượng sử dụng: </strong>Người c&oacute; nhu cầu phục hồi sức khoẻ v&agrave; người c&oacute; nhu cầu tăng cường sức đề kh&aacute;ng.</p>\r\n<p><strong>C&aacute;ch d&ugrave;ng: </strong>Pha 1 th&igrave;a nhỏ (tương đương 2,5 g) với 1 cốc nước ấm 50ml, khuấy nhẹ đều. D&ugrave;ng 1-2 lần/ ng&agrave;y.</p>\r\n<p><strong>Thận trọng: </strong>Kh&ocirc;ng d&ugrave;ng Nấm Tr&ugrave;ng Thảo trong trường hợp bệnh nh&acirc;n c&oacute; vết thương hở đang chảy m&aacute;u hoặc dị ứng với bất kỳ th&agrave;nh phần n&agrave;o của sản phẩm.</p>\r\n<p><strong>Bảo quản: </strong>Bảo quản nơi kh&ocirc; r&aacute;o, tr&aacute;nh &aacute;nh s&aacute;ng trực tiếp.</p>\r\n<p><strong>Quy c&aacute;ch đ&oacute;ng g&oacute;i: </strong>Hộp 1 lọ cao đặc.</p>\r\n<p><span style=\"color: #ff0000;\">*Sản phẩm n&agrave;y kh&ocirc;ng phải l&agrave; thuốc v&agrave; kh&ocirc;ng c&oacute; t&aacute;c dụng thay thế thuốc chữa bệnh.</span></p>','products/June2019/ve6q18ztFvDO3qMwM0gv.jpg','cao-nam-trung-thao-cordy-x','1350000','Đông trùng hạ thảo','2019-03-29 17:25:07','2019-06-25 19:52:03',NULL,NULL,NULL,NULL),(4,'Nguồn gốc xuất xứ',1,'Đông trùng hạ thảo (tươi) và nấm linh chi (khô) được chiết xuất bằng cồn thực phẩm kết hợp công nghệ hiện đại từ Hàn Quốc giúp giữ nguyên hàm lượng dược chất.',NULL,'<p class=\"MsoNormal\"><strong>Cao Nấm Tr&ugrave;ng Thảo CORDY&ndash;X</strong>&nbsp;l&agrave; sản phẩm được nghi&ecirc;n cứu &amp; ph&aacute;t triển, chuyển giao c&ocirc;ng nghệ từ Đại Học Thủ Dầu Một. Sản phẩm l&agrave;&nbsp;<strong>Cao Đặc</strong> chứa tinh chất Đ&Ocirc;NG TR&Ugrave;NG HẠ THẢO v&agrave; tinh chất NẤM LINH CHI. Để đảm bảo sản phẩm c&oacute; được h&agrave;m lượng dược chất cao nhất, c&aacute;c nh&agrave; khoa học đ&atilde; rất ch&uacute; trọng đến từng giai đoạn trong qu&aacute; tr&igrave;nh ph&aacute;t triển v&agrave; h&igrave;nh th&agrave;nh n&ecirc;n CORDY-X:</p>\r\n<ul>\r\n<li class=\"MsoNormal\"><strong>Con giống:</strong> Được nhập khẩu từ ATCC - Ng&acirc;n h&agrave;ng giống Hoa Kỳ uy t&iacute;n nhất thế giới.</li>\r\n<li class=\"MsoNormal\"><strong>M&ocirc;i trường nu&ocirc;i trồng:</strong> Thiết lập m&ocirc;i tường nu&ocirc;i trồng v&ocirc; tr&ugrave;ng, tu&acirc;n thủ nghi&ecirc;m ngặt c&aacute;c ti&ecirc;u ch&iacute; về nhiệt độ, độ ẩm &amp; &aacute;nh s&aacute;ng th&ocirc;ng qua hệ thống gi&aacute;m s&aacute;t tự động (giống như m&ocirc;i trường sinh trưởng của Đ&Ocirc;NG TR&Ugrave;NG HẠ THẢO ngo&agrave;i tự nhi&ecirc;n).</li>\r\n<li class=\"MsoNormal\"><strong>C&Ocirc;NG NGHỆ CHIẾT XUẤT NHIỆT LẠNH &amp; C&Ocirc; ĐẶC CH&Acirc;N KH&Ocirc;NG:<br /></strong> <strong>&nbsp; </strong>&nbsp; <strong>o</strong>&nbsp; Chỉ sử dụng Quả Thể c&ograve;n tươi để chiết xuất, tuyệt đối kh&ocirc;ng d&ugrave;ng cồn c&ocirc;ng nghiệp trong qu&aacute; tr&igrave;nh chiết xuất.<br /><strong>&nbsp; &nbsp; o&nbsp; </strong>D&acirc;y chuyền chiết xuất PH&Acirc;N TỬ hiện đại (từ H&agrave;n Quốc) gi&uacute;p Sản Phẩm c&oacute; độ h&ograve;a tan v&agrave; thẩm thấu nhanh.</li>\r\n</ul>','products/June2019/Al0pwKQQkLj25RvVOnuA.png','nguon-goc-xuat-xu','9000000','Dược chất','2019-03-28 09:37:15','2019-06-25 19:51:38',NULL,NULL,NULL,NULL),(5,'Đông trùng hạ thảo là gì - Nguồn gốc từ đâu',3,'Nhiều người vẫn thường truyền tai nhau về những giá trị sức khỏe mà đông trùng hạ thảo mang lại, tuy nhiên chúng ta đã thật sự hiểu hết về nguồn gốc cũng như công dụng của “tiên dược” được nhiều người ưa chuộng này?',NULL,'<p class=\"MsoNormal\">Nhiều người vẫn thường truyền tai nhau về những gi&aacute; trị sức khỏe m&agrave; đ&ocirc;ng tr&ugrave;ng hạ thảo mang lại, tuy nhi&ecirc;n ch&uacute;ng ta đ&atilde; thật sự hiểu hết về nguồn gốc cũng như c&ocirc;ng dụng của &ldquo;ti&ecirc;n dược&rdquo; được nhiều người ưa chuộng n&agrave;y?</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\">Đ&ocirc;ng tr&ugrave;ng hạ thảo l&agrave; g&igrave;?</h3>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Chỉ từ t&ecirc;n gọi, ch&uacute;ng ta c&oacute; thể hiểu được sản phẩm &ldquo;biệt dược tiền tỉ&rdquo; n&agrave;y l&agrave; kết quả của sự cộng sinh v&ocirc; c&ugrave;ng ho&agrave;n hảo giữa một giống lo&agrave;i thực vật&nbsp;v&agrave; động vật, cụ thể ở đ&acirc;y ch&iacute;nh l&agrave; lo&agrave;i nấm t&uacute;i c&oacute; t&ecirc;n gọi Cordyceps sinensis v&agrave; ấu tr&ugrave;ng non thuộc chi Hepialus.</p>\r\n<p class=\"MsoNormal\">Qu&aacute; tr&igrave;nh để cho ra đời sự kết hợp đặc biệt n&agrave;y cũng kh&ocirc;ng hề đơn giản ch&uacute;t n&agrave;o. V&agrave;o m&ugrave;a đ&ocirc;ng, nấm sẽ k&yacute; sinh v&agrave;o s&acirc;u non v&agrave; ăn hết chất dinh dưỡng của ch&uacute;ng l&agrave;m s&acirc;u non chết đi. Ấu tr&ugrave;ng trong s&acirc;u non bắt đầu lớn dần l&ecirc;n v&agrave; mọc ra khỏi lo&agrave;i vật n&agrave;y khi m&ugrave;a h&egrave; đến rồi vươn l&ecirc;n như một ngọn cỏ, h&igrave;nh th&agrave;nh n&ecirc;n thứ sản phẩm qu&yacute; hiếm với t&ecirc;n gọi đ&ocirc;ng tr&ugrave;ng hạ thảo.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\">T&aacute;c dụng của đ&ocirc;ng tr&ugrave;ng hạ thảo</h3>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Lu&ocirc;n được quảng c&aacute;o l&agrave; sản phẩm cực kỳ bổ đối với nam giới nhưng đ&acirc;y kh&ocirc;ng phải l&agrave; c&ocirc;ng dụng duy nhất đ&ocirc;ng tr&ugrave;ng hạ thảo mang lại m&agrave; c&ograve;n v&ocirc; v&agrave;n những t&aacute;c dụng hữu &iacute;ch kh&aacute;c.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Thanh lọc cơ thể</strong>: Gi&uacute;p thải độc v&agrave; loại bỏ đi c&aacute;c t&aacute;c nh&acirc;n xấu b&ecirc;n trong cơ thể để lu&ocirc;n cảm thấy thật tươi trẻ v&agrave; dễ chịu.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Ph&ograve;ng chống bệnh thận</strong>: Gi&uacute;p người d&ugrave;ng bảo vệ thận do thiếu m&aacute;u, tăng cường nội tiết tố ở v&ugrave;ng thượng thận cũng như hồi phục tế b&agrave;o tiểu quản ở thận một c&aacute;ch hiệu quả.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Giữ độ ổn định cho tim mạch, huyết &aacute;p</strong>: Gi&uacute;p cho nhịp đập của tim cũng như huyết &aacute;p lu&ocirc;n ở trạng th&aacute;i b&igrave;nh ổn, đồng thời gi&uacute;p người sử dụng chống lại hiện tượng thiếu m&aacute;u cơ tim.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Khả năng hoạt huyết</strong>: Giảm h&agrave;m lượng cholesterol trong m&aacute;u, chống chứng xơ vữa động mạch v&agrave; điều tiết nồng độ đường trong m&aacute;u.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Tăng cường sức đề kh&aacute;ng</strong>: Với c&ocirc;ng dụng gi&uacute;p cải thiện t&iacute;nh miễn dịch đặc hiệu, n&acirc;ng cao chức năng ti&ecirc;u h&oacute;a v&agrave; hấp thụ, đ&ocirc;ng tr&ugrave;ng hạ thảo rất th&iacute;ch hợp với những người bệnh cần phục hồi sức khỏe hoặc tăng cường sức đề kh&aacute;ng.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><!-- [if !supportLists]-->-&nbsp;<!--[endif]--><strong>Tốt cho người lớn tuổi</strong>: Những tinh chất c&oacute; trong sản phẩm sẽ gi&uacute;p chống lại qu&aacute; tr&igrave;nh l&atilde;o h&oacute;a v&agrave; hạn chế bệnh tật của tuổi gi&agrave;.</p>\r\n<p class=\"15\" style=\"margin-left: 36.0000pt; text-indent: -18.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; mso-list: l0 level1 lfo1;\" align=\"justify\"><strong>- Tốt cho phụ nữ</strong>: Gi&uacute;p tăng cường ho&oacute;c&nbsp;m&ocirc;n sinh dục của những bạn g&aacute;i đang ở tuổi dậy th&igrave;, l&agrave;m chậm qu&aacute; tr&igrave;nh m&atilde;n kinh để phụ nữ lu&ocirc;n trong độ tuổi hồi xu&acirc;n v&agrave; đặc biệt cải thiện l&agrave;n da một c&aacute;ch đ&aacute;ng kể.</p>\r\n<p class=\"MsoNormal\">Với nguồn gốc v&agrave; c&ocirc;ng dụng tuyệt vời mang lại, việc người d&ugrave;ng ưa th&iacute;ch sử dụng sản phẩm n&agrave;y l&agrave; điều rất dễ hiểu, tuy nhi&ecirc;n để t&igrave;m được một địa chỉ b&aacute;n h&agrave;ng uy t&iacute;n kh&ocirc;ng phải l&agrave; chuyện dễ d&agrave;ng. L&agrave; c&ocirc;ng ty Dược phẩm uy t&iacute;n h&agrave;ng đầu Việt Nam lu&ocirc;n ch&uacute; trọng v&agrave;o chất lượng v&agrave; sức khỏe của kh&aacute;ch h&agrave;ng, <a href=\"https://mhdpharma.com\">MHD Pharma</a> tự h&agrave;o mang đến sản phẩm đạt chuẩn chất lượng tốt nhất được tinh chế từ đ&ocirc;ng tr&ugrave;ng hạ thảo.</p>','products/April2019/9Tzpp7UVuM2wQ6ovMDR5.png','dong-trung-ha-thao-la-gi-nguon-goc-tu-dau','9000000','Brand','2019-03-29 17:25:07','2019-04-12 04:10:02',NULL,NULL,NULL,NULL),(6,'Chức năng sản phẩm',1,'Sản phẩm cao đặc là sự kết hợp tinh chất Đông trùng hạ thảo và tinh chất nấm linh chi hỗ trợ giúp bồi bổ sức khoẻ và tăng cường sức đề kháng cho cơ thể.',NULL,'<p class=\"MsoNormal\">Sản phẩm cao đặc l&agrave; sự kết hợp tinh chất Đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi hỗ trợ gi&uacute;p bồi bổ sức khoẻ v&agrave; tăng cường sức đề kh&aacute;ng cho cơ thể.</p>','products/June2019/1d1NMv9VHk8fkudXB9Hw.png','chuc-n-ng-san-pham','9000000','Lợi ích','2019-03-29 17:25:07','2019-06-25 19:51:26',NULL,NULL,NULL,NULL),(8,'Quà tặng sức khoẻ cho người thân yêu nhất',3,'Xu hướng quà tặng sức khỏe đang phát triển mạnh mẽ khi mà điều khiện sống ngày một nâng cao và mọi người ngày càng quan tâm bản thân hơn. Vì thế, hôm nay MHD Pharma sẽ gợi ý cho các bạn một số món quà tặng sức khỏe cực kì bổ ích .',NULL,'<p>Xu hướng qu&agrave; tặng sức khỏe đang ph&aacute;t triển mạnh mẽ khi m&agrave; điều khiện sống ng&agrave;y một n&acirc;ng cao v&agrave; mọi người ng&agrave;y c&agrave;ng quan t&acirc;m bản th&acirc;n hơn. V&igrave; thế, h&ocirc;m nay MHD Pharma sẽ gợi &yacute; cho c&aacute;c bạn một số m&oacute;n qu&agrave; tặng sức khỏe cực k&igrave; bổ &iacute;ch.</p>\r\n<h3 style=\"margin-top: 1px;\">Đ&ocirc;ng tr&ugrave;ng hạ thảo - Qu&agrave; tặng sức khoẻ gi&agrave;u năng lượng</h3>\r\n<p>Đ&ocirc;ng tr&ugrave;ng hạ thảo gần đ&acirc;y nổi l&ecirc;n như một hiện tượng qu&agrave; tặng d&agrave;nh cho sức khoẻ qu&yacute; gi&aacute; v&agrave; đắt tiền. Được biết đến với h&agrave;m lượng dược chất v&agrave; khả năng hỗ trợ điều trị nhiều loại bệnh l&yacute; kh&aacute;c nhau. <a href=\"http://greenliving.vip/chi-tiet-san-pham?3&amp;Cao%20Nấm%20Tr&ugrave;ng%20Thảo%20CORDY%20-%20X\">Đ&ocirc;ng tr&ugrave;ng hạ thảo</a> ng&agrave;y c&agrave;ng được nhiều người tin tưởng lựa chọn c&ugrave;ng với tổ yến v&agrave; nh&acirc;n s&acirc;m.</p>\r\n<p>Trong quả thể nấm đ&ocirc;ng tr&ugrave;ng hạ thảo chứa rất nhiều hợp chất polysaccharides c&oacute; t&aacute;c dụng chống oxy ho&aacute; cực mạnh v&agrave; giảm stress; nhờ đ&oacute; gi&uacute;p chống lại qu&aacute; tr&igrave;nh l&atilde;o ho&aacute; sơm. B&ecirc;n cạnh đ&oacute;, <strong>đ&ocirc;ng tr&ugrave;ng hạ thảo Cordy-X</strong> c&ograve;n c&oacute; thể điều ho&agrave; đường huyết, giảm cholesterol v&agrave; tăng cường sức đề kh&aacute;ng</p>\r\n<h3 style=\"margin-top: 1px;\">Tổ yến - Qu&agrave; tặng sức khoẻ tốt cho hệ thần kinh</h3>\r\n<p>Kh&ocirc;ng sai đ&acirc;u nh&eacute;, tổ yến từng được mệnh danh l&agrave; cao lương mĩ vị - tổ yến s&agrave;o được chế biến từ tổ của chim yến. Theo khoa học chứng minh, trong tổ yến s&agrave;o c&oacute; chứa h&agrave;m lượng protein cao, trong đ&oacute; c&oacute; tận 18 loại axit amin, một số axit amin kh&ocirc;ng thể thay thế như cystein, phenylalanine c&oacute; t&aacute;c dụng tăng cường tr&iacute; nhớ, tăng dẫn truyền xung động thần kinh.</p>\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; font-size: 11.0000pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-2\" src=\"http://greenliving.vip/storage/products/April2019/qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-2.jpg\" alt=\"qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-2\" width=\"750\" /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Tổ yến. (Ảnh: pinterest)</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\">Nh&acirc;n s&acirc;m - Qu&agrave; tặng sức khoẻ tốt cho da</h3>\r\n<p>Nh&acirc;n s&acirc;m cũng l&agrave; một loại thảo dược m&agrave; bạn kh&ocirc;ng thể kh&ocirc;ng biết, n&oacute; cũng c&oacute; rất nhiều t&aacute;c dụng hỗ trợ v&agrave; điều trị như tăng sức đề kh&aacute;ng, chống đỡ bệnh tật v&agrave; đặc biệt l&agrave; ngăn ngừa l&atilde;o ho&aacute; da. Đ&acirc;y cũng l&agrave; th&agrave;nh phần ch&iacute;nh được c&aacute;c nh&atilde;n mỹ phẩm ưa chuộng, cực kỳ hiệu quả cho da.</p>\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun: \'yes\'; font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; font-size: 11.0000pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-3\" src=\"http://greenliving.vip/storage/products/April2019/qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-3.jpg\" alt=\"qua-tang-suc-khoe-cho-nguoi-than-yeu-nhat-3\" width=\"750\" /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><span style=\"text-align: start;\"><em><strong>Lee</strong></em></span></p>','products/April2019/gzjsB5BugrVPTRjEDys4.jpg','qua-tang-suc-khoe-cho-ng-oi-than-yeu-nhat','9000000','quà tặng','2019-03-29 17:25:07','2019-04-12 04:10:55',NULL,NULL,NULL,NULL),(9,'Làm thế nào để tăng sức đề kháng cho cơ thể',3,'Nếu biết cách phòng tránh và bảo vệ cơ thể từ bên trong bằng việc tăng sức đề kháng thì các loại vi khuẩn, virus có hại sẽ không thể phát huy tác hại khi xâm nhập vào cơ thể bạn.',NULL,'<p>Nếu biết c&aacute;ch ph&ograve;ng tr&aacute;nh v&agrave; bảo vệ cơ thể từ b&ecirc;n trong bằng việc tăng sức đề kh&aacute;ng th&igrave; c&aacute;c loại vi khuẩn, virus c&oacute; hại sẽ kh&ocirc;ng thể ph&aacute;t huy t&aacute;c hại khi x&acirc;m nhập v&agrave;o cơ thể bạn.</p>\r\n<h3 style=\"margin-top: 1px;\"><strong>Cung cấp đầy đủ dưỡng chất thiết yếu cho cơ thể</strong></h3>\r\n<p>Cơ thể sẽ tạo ra kh&aacute;ng thể cần thiết từ c&aacute;c axit amin tiềm ẩn trong c&aacute;c m&oacute;n ăn để chống lại mối đe doạ đối với sức khoẻ. Nguồn cung cấp chất đạm trước ti&ecirc;n l&agrave; thịt. Song sẽ rất tốt, nếu thay thế, cho d&ugrave; một phần - bằng c&aacute;c loại c&aacute;, đậu đỗ, những thực vật c&oacute; củ. Trong thực đơn h&agrave;ng ng&agrave;y cũng kh&ocirc;ng thể thiếu c&aacute;c vitamin v&agrave; c&aacute;c vi kho&aacute;ng. Tr&aacute;i lại cần hạn chế số lượng hydrat-c&aacute;cbon (b&aacute;nh ngọt, vốn k&igrave;m h&atilde;m hoạt động của hệ đề kh&aacute;ng), hạn chế chất b&eacute;o c&oacute; nguồn gốc động vật (thịt mỡ v&agrave; mỡ động vật). Ch&uacute;ng l&agrave;m gia tăng nồng độ cholesteron v&agrave; triglicerit trong m&aacute;u. Những hợp chất đ&oacute; c&agrave;ng nhiều, năng lực ti&ecirc;u diệt vi tr&ugrave;ng của bạch cầu c&agrave;ng thấp.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Thu-gian-cuoi-tuan-12\" src=\"http://greenliving.vip/storage/products/April2019/Tang-cuong-suc-de-khang-1.png\" alt=\"Thu-gian-cuoi-tuan-12\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Bổ sung c&aacute;c kho&aacute;ng chất thiết yếu trong c&aacute;c bữa ăn. (Ảnh: webvitamin)</p>\r\n<h3 style=\"margin-top: 1px;\">Hạn chế sử dụng chất k&iacute;ch để tăng sức đề kh&aacute;ng cho cơ thể</h3>\r\n<p>Khi uống rượu v&agrave; h&uacute;t thuốc, cơ thể sẽ mất dần sự tự vệ v&igrave; phải li&ecirc;n tục v&ocirc; hiệu h&oacute;a c&aacute;c th&agrave;nh phần tự do xuất hiện khi h&uacute;t thuốc v&agrave; Vitamin trong cơ thể cũng bị hủy diệt bởi rượu. V&igrave; thế, cố gắng hạn chế h&uacute;t thuốc, bổ sung Vitamin hoặc chỉ n&ecirc;n uống 1 ly rượu vang th&ocirc;i nh&eacute;.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Tang-suc-de-khang-2\" src=\"http://greenliving.vip/storage/products/April2019/Tang-cuong-suc-de-khang-2.png\" alt=\"Tăng sức đề kh&aacute;ng\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Hạn chế sử dụng c&aacute;c chất k&iacute;ch th&iacute;ch như thuốc l&aacute;, rượu, bia&hellip; (Ảnh: hellobacsi)</p>\r\n<h3 style=\"margin-top: 1px;\">Tăng cường sức đề kh&aacute;ng cho cơ thể với c&aacute;c loại hoa quả v&agrave; thảo dược tự nhi&ecirc;n</h3>\r\n<p>Một số thảo dược ph&aacute;t huy t&aacute;c dụng k&iacute;ch th&iacute;ch v&agrave; củng cố hệ miễn dịch cơ thể. Thỉnh thoảng cần tận dụng khả năng của ch&uacute;ng. Nhất l&agrave; v&agrave;o những ng&agrave;y thời tiết thất thường, khi ch&uacute;ng ta dễ bị c&uacute;m v&agrave; c&aacute;c bệnh l&acirc;y nhiễm kh&aacute;c.</p>\r\n<p>C&aacute;c loại hoa quả v&agrave; thảo dược tự nhi&ecirc;n tốt nhất với cơ thể để&nbsp;<strong>tăng sức đề kh&aacute;ng&nbsp;</strong>l&agrave;: bưởi, cam, chanh, c&aacute;c sản phẩm chế biến từ nh&acirc;n s&acirc;m, c&acirc;y l&ocirc; hội v&agrave; <a href=\"http://greenliving.vip/san-pham\">Cao Nấm Tr&ugrave;ng Thảo Cordy-X</a> của MHD Pharma.</p>','products/April2019/1auwIMCLiFytxzMdXllm.png','lam-the-nao-de-t-ng-suc-de-khang-cho-c-the','1','Lifestyle','2019-03-29 17:25:07','2019-04-12 04:11:25',NULL,NULL,NULL,NULL),(10,'Phục hồi sức khoẻ với đông trùng hạ thảo',3,'Suy nhược cơ thể, đây là bệnh lý chung trong những ngày nắng nóng đầu hè. Để MHD pharma giới thiệu các bạn cách bảo vệ và phục hồi sức khỏe hiệu quả nhất.',NULL,'<p>Suy nhược cơ thể, đ&acirc;y l&agrave; bệnh l&yacute; chung trong những ng&agrave;y nắng n&oacute;ng đầu h&egrave;. Để MHD pharma giới thiệu c&aacute;c bạn c&aacute;ch bảo vệ v&agrave; phục hồi sức khỏe hiệu quả nhất.</p>\r\n<h3 style=\"margin-top: 1px;\">Nguy&ecirc;n nh&acirc;n dẫn đến suy nhược cơ thể</h3>\r\n<p>Cơ thể bắt đầu l&ecirc;n tiếng khi c&aacute;c bạn l&agrave;m việc qu&aacute; sức, suy nghĩ nhiều, căng thẳng mệt mỏi, nhưng lại kh&ocirc;ng bổ sung đủ dưỡng chất cần thiết. Một điều rất dễ thấy l&agrave; c&aacute;c bạn rất tham việc, kh&ocirc;ng d&agrave;nh thời gian để nghỉ ngơi v&agrave; đặc biệt l&agrave; lười vận động, cũng c&oacute; những bạn suy nhược cơ thể v&igrave; mới hết bệnh hay đang mang thai. Đừng lo nh&eacute;, <a href=\"http://greenliving.vip/san-pham\">Cao nấm tr&ugrave;ng thảo CORDY &ndash; X</a> l&agrave; con cưng của MHD Pharma, hỗ trợ rất tốt trong vấn đề&nbsp;<strong>phục hồi sức khỏe.</strong></p>\r\n<h3 style=\"margin-top: 1px;\">Những điều cần l&agrave;m để phục hồi sức khỏe</h3>\r\n<ol>\r\n<li><strong>Tr&aacute;nh ăn đường v&agrave; nhiều ngũ cốc:&nbsp;</strong>thực phẩm chứa nhiều đường khiến th&acirc;n thể tiết ra nhiều serotonin, g&acirc;y n&ecirc;n t&igrave;nh trạng buồn ngủ. Đặc biệt l&agrave; sau khi thức khuya vẫn cần tiếp tục học tập, th&igrave; n&ecirc;n tr&aacute;nh ăn đồ ngọt, ngũ cốc để kh&ocirc;ng bị ngủ gật.</li>\r\n<li><strong>Bổ sung vitamin B12:&nbsp;</strong>vitamin B12 vốn rất trọng yếu trong việc cung cấp năng lượng cho cơ thể. Thiếu vitamin B12 kh&ocirc;ng chỉ khiến cơ thể c&oacute; cảm gi&aacute;c mệt mỏi, m&agrave; c&ograve;n dẫn đến nhận thức suy giảm, t&acirc;m trạng ủ rũ.</li>\r\n<li>S<strong>ử dụng c&aacute;c thảo dược thi&ecirc;n nhi&ecirc;n:</strong>&nbsp;C&aacute;c loại thảo dược từ thi&ecirc;n nhi&ecirc;n sẽ rất tốt trong qu&aacute; tr&igrave;nh trao đổi chất, v&igrave; thế đ&acirc;y cũng l&agrave; một biện ph&aacute;p phục hồi sức khỏe rất tốt. Lưu &yacute;, t&ugrave;y theo t&igrave;nh trạng thể chất đang bị suy nhược thiếu dưỡng chất n&agrave;o m&igrave;nh bổ sung dưỡng chất đ&oacute;.</li>\r\n</ol>\r\n<h3 style=\"margin-top: 1px;\">Đ&ocirc;ng tr&ugrave;ng hạ thảo c&oacute; t&aacute;c động như thế n&agrave;o đến việc phục hồi sức khỏe</h3>\r\n<p>Đ&ocirc;ng tr&ugrave;ng hạ thảo được xem l&agrave; loại thực phẩm c&acirc;n bằng &acirc;m dương tuyệt đối ph&ugrave; hợp&nbsp;<strong>phục hồi sức khỏe</strong>cho c&aacute;c bạn. Th&ecirc;m v&agrave;o đ&oacute;, những dược chất v&ocirc; c&ugrave;ng qu&yacute; hiếm c&oacute; khả năng gi&uacute;p cơ thể ph&ograve;ng ngừa v&agrave; hỗ trợ điều trị ung thư, Đ&ocirc;ng tr&ugrave;ng hạ thảo trở l&ecirc;n HOT hơn bao giờ hết.</p>\r\n<p>Cao nấm tr&ugrave;ng thảo CORDY&ndash;X của MHD pharma l&agrave; sản phẩm Cao đặc kết hợp giữa tinh chất Đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất Nấm linh chi, l&agrave; hai loại dược liệu qu&yacute; sử dụng từ rất l&acirc;u trong y học cổ truyền với những b&agrave;i thuốc hỗ trợ&nbsp;<strong>phục hồi sức khoẻ</strong>. Đặc biệt, đ&acirc;y l&agrave; sản phẩm dạng cao rất dễ hấp thụ v&agrave;o cơ thể. Bạn c&oacute; thể t&igrave;m hiểu th&ecirc;m sản phẩm tại Gia đ&igrave;nh Cordy.</p>','products/April2019/mwhBFnhBQATKADLkflww.jpg','phuc-hoi-suc-khoe-voi-dong-trung-ha-thao','1','health tips','2019-03-29 17:25:07','2019-04-12 04:11:50',NULL,NULL,NULL,NULL),(11,'Cách phân loại đông trùng hạ thảo để lựa chọn đúng đắn',3,'Với việc trên thế giới có đến hơn 500 loài trùng thảo khác nhau nhưng không phải loại đông trùng hạ thảo nào cũng được xem là “thần dược” giúp mang lại giá trị bổ ích cho người sử dụng.',NULL,'<p>Với việc tr&ecirc;n thế giới c&oacute; đến hơn 500 lo&agrave;i tr&ugrave;ng thảo kh&aacute;c nhau nhưng kh&ocirc;ng phải loại đ&ocirc;ng tr&ugrave;ng hạ thảo n&agrave;o cũng được xem l&agrave; &ldquo;thần dược&rdquo; gi&uacute;p mang lại gi&aacute; trị bổ &iacute;ch cho người sử dụng.</p>\r\n<h3 style=\"margin-top: 1px;\">Ph&acirc;n loại đ&ocirc;ng tr&ugrave;ng hạ thảo</h3>\r\n<p>Lo&agrave;i &ldquo;ti&ecirc;n dược&rdquo; n&agrave;y được ph&acirc;n loại dựa theo 2 ti&ecirc;u ch&iacute; đ&oacute; l&agrave; theo&nbsp;nguồn gốc xuất xứv&agrave; theo khoa học.</p>\r\n<p><strong>Theo nguồn gốc:</strong></p>\r\n<ul>\r\n<ul>\r\n<li>Tự nhi&ecirc;n: được t&igrave;m thấy chủ yếu tr&ecirc;n c&aacute;c v&ugrave;ng n&uacute;i cao khoảng 4.000m ở cao nguy&ecirc;n T&acirc;y Tạng v&agrave; Tứ Xuy&ecirc;n Trung Quốc.</li>\r\n<li>Nh&acirc;n tạo: tại c&aacute;c nước ph&aacute;t triển v&agrave; đang ph&aacute;t triển như Mỹ, Nhật, H&agrave;n, Th&aacute;i Lan v&agrave; đặc biệt l&agrave; ở Việt Nam, c&aacute;c nh&agrave; khoa học v&agrave; sinh vật học đ&atilde; nghi&ecirc;n cứu v&agrave; nu&ocirc;i trồng th&agrave;nh c&ocirc;ng đ&ocirc;ng tr&ugrave;ng hạ thảo nhờ v&agrave;o c&aacute;c biện ph&aacute;p nh&acirc;n tạo.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>Theo khoa học:</strong></p>\r\n<ul>\r\n<li>Đ&ocirc;ng tr&ugrave;ng hạ thảo: l&agrave; sự kết hợp cộng sinh giữa lo&agrave;i nấm t&uacute;i c&oacute; t&ecirc;n Cordyceps sinensis v&agrave; ấu tr&ugrave;ng s&acirc;u non thuộc chi Hepialus.</li>\r\n<li>Nhộng tr&ugrave;ng thảo hoặc b&aacute;ch tr&ugrave;ng thảo: l&agrave; lo&agrave;i c&acirc;y nấm mọc từ một bộ phận kh&aacute;c của con s&acirc;u v&agrave; th&acirc;n c&acirc;y sẽ c&oacute; m&agrave;u v&agrave;ng ngả hồng.</li>\r\n</ul>\r\n<h3 style=\"margin-top: 1px;\">Đ&ocirc;ng tr&ugrave;ng hạ thảo nu&ocirc;i c&oacute; qu&yacute; như loại tự nhi&ecirc;n?</h3>\r\n<p>Một trong những c&acirc;u hỏi được rất nhiều người d&ugrave;ng quan t&acirc;m đ&oacute; ch&iacute;nh l&agrave; liệu sử dụng đ&ocirc;ng tr&ugrave;ng hạ thảo nu&ocirc;i trồng c&oacute; tốt bằng lo&agrave;i tự nhi&ecirc;n? Theo &yacute; kiến ph&aacute;t biểu tại buổi tọa đ&agrave;m trực tuyến \"Thị trường đ&ocirc;ng tr&ugrave;ng hạ thảo Việt Nam - minh bạch v&agrave; ph&aacute;t triển\" của Tiến Sĩ Phạm Văn Nha &ndash; Gi&aacute;m đốc trung t&acirc;m đấu tranh sinh học của Viện bảo vệ thực phẩm Bộ NNPTNT cho biết, việc so s&aacute;nh đ&ocirc;ng tr&ugrave;ng hạ thảo tự nhi&ecirc;n hay nu&ocirc;i trồng qu&yacute; hơn phụ thuộc rất nhiều v&agrave;o yếu tố m&ocirc;i trường nu&ocirc;i dưỡng như thế n&agrave;o. V&igrave; d&ugrave; c&oacute; lựa chọn được chủng nấm tốt nhưng qu&aacute; tr&igrave;nh nu&ocirc;i cấy c&oacute; m&ocirc;i trường kh&ocirc;ng tốt, sản phẩm cũng kh&ocirc;ng thể n&agrave;o đạt chất lượng tuyệt đối được. &Ocirc;ng cũng n&oacute;i th&ecirc;m, những dược chất c&oacute; trong sản phẩm sẽ dần mất hết chỉ sau 2 th&aacute;ng nếu c&aacute;ch sơ chế kh&ocirc;ng được đảm bảo ở nhiệt độ dưới 50 độ C hoặc c&aacute;ch bảo quản kh&ocirc;ng đ&uacute;ng chuẩn.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"phan-loai-dong-trung-ha-thao-2\" src=\"http://greenliving.vip/storage/products/April2019/cach-phan-loai-dong-trung-ha-thao-1.png\" alt=\"ph&acirc;n loại đ&ocirc;ng tr&ugrave;ng ha thao\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Cao nấm tr&ugrave;ng thảo Cordy-X &ndash; Sản phẩm đạt điểm chuẩn cho chất lượng (Ảnh: greenliving)</p>\r\n<p>Với c&ocirc;ng nghệ chiết suất nhiệt lạnh v&agrave; c&ocirc; đặc ch&acirc;n kh&ocirc;ng ti&ecirc;n tiến gi&uacute;p giữ nguy&ecirc;n h&agrave;m lượng dược chất c&ugrave;ng d&acirc;y chuyền chiết xuất ph&acirc;n tử hiện đại đến từ H&agrave;n Quốc, C&ocirc;ng ty Cổ phẩn MHD Pharma tự tin mang đến cho kh&aacute;ch h&agrave;ng những sản phẩm lu&ocirc;n đạt chất lượng tuyệt đối từ đ&ocirc;ng tr&ugrave;ng hạ thảo với t&ecirc;n gọi Cao Nấm Tr&ugrave;ng Thảo Cordy-X. Để t&igrave;m hiểu th&ocirc;ng tin chi tiết về sản phẩm, truy cập ngay tại đ&acirc;y:&nbsp;<a style=\"color: #954f72;\" href=\"http://greenliving.vip/san-pham\" target=\"_blank\" rel=\"noopener\">Gia Đ&igrave;nh Cordy.</a></p>','products/April2019/0LlFDV8W3DyNSI11G03J.jpg','cach-phan-loai-dong-trung-ha-thao-de-lua-chon-dung-dan','1','brand','2019-03-29 17:25:07','2019-04-12 04:37:29',NULL,NULL,NULL,NULL),(12,'Đông trùng hạ thảo mua tại Việt Nam có tốt không?',3,'Sản phẩm đông trùng hạ thảo được bán tại thị trường Việt Nam ngày càng nhiều khiến cho người dùng trở nên e ngại khi lựa chọn mua. Vậy Đông trùng hạ thảo Việt Nam có tốt không?',NULL,'<p>Sản phẩm đ&ocirc;ng tr&ugrave;ng hạ thảo được b&aacute;n tại thị trường Việt Nam ng&agrave;y c&agrave;ng nhiều khiến cho người d&ugrave;ng trở n&ecirc;n e ngại khi lựa chọn mua. Vậy Đ&ocirc;ng tr&ugrave;ng hạ thảo Việt Nam c&oacute; tốt kh&ocirc;ng?</p>\r\n<p>Một thử nghiệm v&ocirc; c&ugrave;ng đơn giản l&agrave; khi t&igrave;m kiếm từ kh&oacute;a &ldquo;<a href=\"http://greenliving.vip/chi-tiet-san-pham?3&amp;Cao%20Nấm%20Tr&ugrave;ng%20Thảo%20CORDY%20-%20X\">đ&ocirc;ng tr&ugrave;ng hạ thảo</a>&rdquo; tr&ecirc;n Google, số lượng kết quả trả về nhiều đến nỗi l&agrave;m cho ch&uacute;ng ta cảm thấy đắn đo kh&ocirc;ng biết n&ecirc;n v&agrave;o đường dẫn n&agrave;o để tin tưởng lựa chọn sản phẩm bổ &iacute;ch n&agrave;y.&nbsp;V&agrave; c&acirc;u hỏi&nbsp;được rất nhiều người d&ugrave;ng quan t&acirc;m:&nbsp;Đ&ocirc;ng tr&ugrave;ng hạ thảo mua tại Việt Nam c&oacute; thực sự tốt hay kh&ocirc;ng? Dưới đ&acirc;y l&agrave; những&nbsp;băn khoăn&nbsp;của kh&aacute;ch h&agrave;ng khi quyết định mua loại &ldquo;ti&ecirc;n dược&rdquo; n&agrave;y:</p>\r\n<h3 style=\"margin-top: 1px;\">Vấn đề thường gặp phải khi lựa chọn đ&ocirc;ng tr&ugrave;ng hạ thảo tại Việt Nam</h3>\r\n<p>Mua phải tr&ugrave;ng thảo, kh&ocirc;ng phải Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo: Bởi v&igrave; tr&ecirc;n thế giới c&oacute; đến 507 lo&agrave;i tr&ugrave;ng thảo, tuy nhi&ecirc;n trong số đ&oacute; chỉ c&oacute; một giống lo&agrave;i cordyceps sinensis duy nhất được gọi l&agrave; Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo.</p>\r\n<ul>\r\n<li>T&igrave;nh trạng mua tr&uacute;ng h&agrave;ng giả, h&agrave;ng nh&aacute;i, h&agrave;ng bị r&uacute;t hết dược chất: Rất nhiều đơn vị b&aacute;n h&agrave;ng hiện nay sử dụng c&aacute;ch l&agrave;m giả bằng th&acirc;n củ địa t&agrave;m v&agrave; thạch thảo rồi cắm cỏ v&agrave;o, hoặc l&agrave;m bằng bột ng&ocirc;, thạch cao, bột mạch, con s&acirc;u ch&iacute;t&hellip; một c&aacute;ch v&ocirc; c&ugrave;ng tinh vi khiến người mua h&agrave;ng rất kh&oacute; ph&acirc;n biệt.&nbsp;Thậm ch&iacute;, mua nhầm đ&ocirc;ng tr&ugrave;ng hạ thảo bị r&uacute;t hết dược chất, chỉ c&ograve;n lại x&aacute;c dược liệu.</li>\r\n<li>Mua sản phẩm ở những nơi kh&ocirc;ng c&oacute; tr&igrave;nh độ chuy&ecirc;n m&ocirc;n: Những c&aacute; nh&acirc;n hoạt động nhỏ hay chỉ b&aacute;n h&agrave;ng online kh&ocirc;ng c&oacute; bất kỳ kiến thức chuy&ecirc;n m&ocirc;n n&agrave;o về Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo, đến khi người d&ugrave;ng c&oacute; vấn đề hay muốn tư vấn về thể trạng bệnh cũng kh&ocirc;ng thể.</li>\r\n</ul>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"dong-trung-ha-thao-viet-nam\" src=\"http://greenliving.vip/storage/products/April2019/Dong-trung-ha-thao-viet-nam1.png\" alt=\"đ&ocirc;ng tr&ugrave;ng hạ thảo việt nam\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Lựa chọn Cao Nấm Tr&ugrave;ng Thảo tại MHD Pharma để lu&ocirc;n an t&acirc;m sử dụng.</p>\r\n<h3 style=\"margin-top: 1px;\">N&ecirc;n lựa chọn địa chỉ b&aacute;n h&agrave;ng uy t&iacute;n khi mua đ&ocirc;ng tr&ugrave;ng hạ thảo</h3>\r\n<p>Qua những vấn đề tr&ecirc;n, c&oacute; thể dễ d&agrave;ng nhận thấy, để mua được sản phẩm đ&ocirc;ng tr&ugrave;ng hạ thảo chất lượng v&agrave; an t&acirc;m sử dụng, ch&uacute;ng ta cần phải t&igrave;m hiểu r&otilde; những đơn vị b&aacute;n h&agrave;ng uy t&iacute;n, c&oacute; d&acirc;y chuyền sản xuất hiện đại v&agrave; nguồn gốc xuất xứ sản phẩm r&otilde; r&agrave;ng.</p>\r\n<p>C&oacute; hơn 8 năm kinh nghiệm trong lĩnh vực kinh doanh dược phẩm, C&ocirc;ng ty Cổ Phần <a href=\"https://mhdpharma.com\">MHD Pharma</a> tự h&agrave;o l&agrave; một trong những C&ocirc;ng ty Dược phẩm uy t&iacute;n h&agrave;ng đầu Việt Nam mang đến cho kh&aacute;ch h&agrave;ng những sản phẩm tốt v&agrave; chất lượng nhất hiện nay. Đặc biệt, MHD Pharma đ&atilde; c&ugrave;ng Đại học Thủ Dầu Một, đơn vị c&oacute; d&agrave;y năm nghi&ecirc;n cứu v&agrave; nu&ocirc;i trồng đ&ocirc;ng tr&ugrave;ng hạ thảo, nghi&ecirc;n cứu v&agrave; cho ra mắt th&agrave;nh c&ocirc;ng cao đặc kết hợp giữa tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi với t&ecirc;n gọi Cao Nấm Tr&ugrave;ng Thảo Cordy-X c&ugrave;ng nhiều c&ocirc;ng dụng vượt trội, đạt chứng nhận danh hiệu c&uacute;p v&agrave;ng &ldquo;Sản phẩm tin cậy, nh&atilde;n hiệu ưa d&ugrave;ng, dịch vụ ho&agrave;n hảo năm 2015&rdquo; của Tạp ch&iacute; sở hữu tr&iacute; tuệ v&agrave; s&aacute;ng tạo.</p>','products/April2019/DIzH68zBaJWiQ0RTFseh.png','dong-trung-ha-thao-mua-tai-viet-nam-co-tot-khong','1','brand','2019-03-29 17:25:07','2019-04-12 04:33:59',NULL,NULL,NULL,NULL),(13,'Sự kết hợp hoàn hảo từ Đông Trùng Hạ Thảo và Nấm Linh Chi',3,'Đã bao giờ bạn nghe loáng thoáng đâu đó cái tên Cao Nấm Trùng Thảo Cordy - X và cảm thấy thắc mắc sản phẩm này liệu có liên quan gì đến đông trùng hạ thảo cũng như công dụng của sản phẩm là gì?',NULL,'<h3 style=\"margin-top: 1px;\"><strong>Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; g&igrave;?</strong></h3>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Cao Nấm Tr&ugrave;ng Thảo Cordy - X l&agrave; sản phẩm cao đặc chứa tinh chất <a href=\"http://greenliving.vip/san-pham\"><u>đ&ocirc;ng tr&ugrave;ng hạ thảo</u></a>&nbsp;v&agrave; tinh chất nấm linh chi. Sản phẩm được nghi&ecirc;n cứu &amp; ph&aacute;t triển, chuyển giao c&ocirc;ng nghệ từ Đại Học Thủ Dầu Một cho c&ocirc;ng ty Cổ Phần MHD Innocare chịu tr&aacute;ch nhiệm chất lượng sản phẩm, c&ocirc;ng bố, ph&acirc;n phối sản phẩm với t&ecirc;n gọi l&agrave; Cao Nấm Tr&ugrave;ng Thảo Cordy-X. Để đảm bảo sản phẩm lu&ocirc;n giữ được h&agrave;m lượng dược chất cao nhất, c&aacute;c nh&agrave; khoa học đ&atilde; rất ch&uacute; trọng đến từng giai đoạn trong qu&aacute; tr&igrave;nh h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển:</p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\"><!-- [if !supportLists]-->Tuyển chọn v&agrave; nhập khẩu con giống từ ATCC &ndash; Ng&acirc;n h&agrave;ng giống Hoa Kỳ uy t&iacute;n v&agrave; chất lượng nhất thế giới.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">M&ocirc;i trường nu&ocirc;i trồng được thiết lập v&ocirc; tr&ugrave;ng, đảm bảo tu&acirc;n thủ nghi&ecirc;m ngặt c&aacute;c ti&ecirc;u ch&iacute; về nhiệt độ, độ ẩm v&agrave; &aacute;nh s&aacute;ng th&ocirc;ng qua một hệ thống gi&aacute;m s&aacute;t tự động giống như m&ocirc;i trường sinh trưởng ngo&agrave;i tự nhi&ecirc;n của đ&ocirc;ng tr&ugrave;ng hạ thảo.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Chỉ sử dụng những quả thể c&ograve;n tươi để chiết xuất v&agrave; tuyệt đối kh&ocirc;ng d&ugrave;ng cồn c&ocirc;ng nghiệp trong qu&aacute; tr&igrave;nh thực hiện.</li>\r\n<li class=\"MsoNormal\">C&ocirc;ng nghệ chiết xuất nhiệt lạnh v&agrave; c&ocirc; đặc ch&acirc;n kh&ocirc;ng cải tiến c&ugrave;ng d&acirc;y chuyền chiết xuất ph&acirc;n tử hiện đại từ H&agrave;n Quốc gi&uacute;p sản phẩm lu&ocirc;n c&oacute; độ h&ograve;a tan v&agrave; thẩm thấu nhanh.</li>\r\n</ul>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>C&ocirc;ng dụng của sự kết hợp ho&agrave;n hảo giữa tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi</strong></h3>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Sản phẩm Cao Nấm Tr&ugrave;ng Thảo Cordy - X c&oacute; rất nhiều c&ocirc;ng dụng bổ &iacute;ch m&agrave; nổi bật nhất ch&iacute;nh l&agrave;:</p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\"><!-- [if !supportLists]-->Hỗ trợ bồi bổ sức khỏe, tăng cường sức đề kh&aacute;ng cho cơ thể, rất th&iacute;ch hợp với những người lớn tuổi tong tinh trạng suy nhược, suy dinh dưỡng v&agrave; những người đang điều trị hoặc sau điều trị h&oacute;a &ndash; xạ trị.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\"><!-- [if !supportLists]-->C&acirc;n bằng cuộc sống, cải thiện t&igrave;nh trạng mất ngủ hay suy nhược thần kinh đối với những người thường xuy&ecirc;n bị &aacute;p lực c&ocirc;ng việc, người bị rối loạn giấc ngủ sinh l&yacute; hay phụ nữ trong giai đoạn tiền m&atilde;n kinh.</li>\r\n<li class=\"MsoNormal\">Thanh lọc cơ thể, chống oxi h&oacute;a dọn sạch gốc tự do v&agrave; bảo vệ gan thận một c&aacute;ch hiệu quả n&ecirc;n được nhiều đối tượng nh&acirc;n vi&ecirc;n văn ph&ograve;ng hay bệnh nh&acirc;n d&ugrave;ng thuốc l&acirc;u ng&agrave;y ưa chuộng v&agrave; sử dụng.</li>\r\n</ul>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Su-ket-hop-hoan-hao-tu-dong-trung-ha-thao-va-nam-linh-chi-1\" src=\"http://greenliving.vip/storage/products/April2019/Picture1.png\" alt=\"Su-ket-hop-hoan-hao-tu-dong-trung-ha-thao-va-nam-linh-chi-1\" width=\"750\" height=\"500\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><em>Cao nấm tr&ugrave;ng thảo Cordy-X &ndash; Sản phẩm đạt điểm chuẩn cho chất lượng</em></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><strong><em>Lee</em></strong></p>','products/April2019/6QjMLx6JsQKTvMz4fEZd.png','su-ket-hop-hoan-hao-tu-dong-trung-ha-thao-va-nam-linh-chi','1','Brand','2019-04-04 02:55:13','2019-04-12 04:08:41',NULL,NULL,NULL,NULL),(14,'Cao Nấm Trùng Thảo Cordy – X của MHD Pharma có gì đặc biệt?',3,'Giữa vô vàn những địa chỉ rao bán sản phẩm có thành phần đông trùng hạ thảo, việc khách hàng cảm thấy đắn đo và khó lựa chọn là lẽ tất nhiên. Vậy vì sao khách hàng có thể hoàn toàn yên tâm khi tin dùng “tiên dược” đến từ MHD Pharma?',NULL,'<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>C&ocirc;ng ty dược phẩm uy t&iacute;n với hơn 8 năm kinh nghiệm</strong></h3>\r\n<p class=\"MsoNormal\">Được th&agrave;nh lập từ năm 2011, C&ocirc;ng ty cổ phần MHD Pharma được xem l&agrave; c&ocirc;ng ty Dược phẩm uy t&iacute;n h&agrave;ng đầu Việt Nam lu&ocirc;n ch&uacute; trọng v&agrave;o chất lượng sản phẩm, hiệu quả điều trị v&agrave; nhu cầu bệnh nh&acirc;n. Sứ mệnh của ch&uacute;ng t&ocirc;i l&agrave; c&ugrave;ng với c&aacute;c chuy&ecirc;n gia chăm s&oacute;c sức khỏe mang lại sự h&agrave;i l&ograve;ng cho kh&aacute;ch h&agrave;ng của m&igrave;nh th&ocirc;ng qua c&aacute;c sản phẩm chăm s&oacute;c sức khỏe chất lượng cao v&agrave; dịch vụ thật ho&agrave;n hảo.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Kh&ocirc;ng chỉ đơn giản l&agrave; đ&ocirc;ng tr&ugrave;ng hạ thảo th&ocirc;ng thường</strong></h3>\r\n<p class=\"MsoNormal\">Nếu như những đơn vị sản xuất v&agrave; ph&acirc;n phối kh&aacute;c chỉ tập trung v&agrave;o <a href=\"http://greenliving.vip/\"><u>đ&ocirc;ng tr&ugrave;ng hạ thảo</u></a> th&igrave; MHD Pharma đ&atilde; c&oacute; bước tiến xa hơn về c&ocirc;ng nghệ. MHD Pharma hợp t&aacute;c c&ugrave;ng Đại học Thủ Dầu Một để cho ra mắt th&agrave;nh c&ocirc;ng cao đặc kết hợp giữa tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi, với t&ecirc;n gọi <strong>Cao Nấm Tr&ugrave;ng Thảo Cordy-X</strong> được rất nhiều người ưa chuộng v&agrave; tin tưởng sử dụng. Chất lượng của sản phẩm đ&atilde; được Tạp ch&iacute; sở hữu tr&iacute; tuệ v&agrave; s&aacute;ng tạo trao tặng danh hiệu c&uacute;p v&agrave;ng &ldquo;Sản phẩm tin cậy, nh&atilde;n hiệu ưa d&ugrave;ng, dịch vụ ho&agrave;n hảo năm 2015&rdquo;.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Qu&aacute; tr&igrave;nh sản xuất chất lượng</strong></h3>\r\n<p class=\"MsoNormal\">Với mong muốn mang đến những sản phẩm chất lượng nhất đến với kh&aacute;ch h&agrave;ng, MHD&nbsp;Pharma kết hợp c&ugrave;ng Đại Học Thủ Dầu Một rất ch&uacute; trọng v&agrave;o qu&aacute; tr&igrave;nh sản xuất của m&igrave;nh bằng c&aacute;ch &aacute;p dụng những cải tiến c&ocirc;ng nghệ về chiết xuất nhiệt lạnh v&agrave; c&ocirc; đặc ch&acirc;n kh&ocirc;ng, đảm bảo sản phẩm được nu&ocirc;i cấy trong một m&ocirc;i trường v&ocirc; tr&ugrave;ng y như m&ocirc;i trường sinh trưởng của đ&ocirc;ng tr&ugrave;ng hạ thảo ngo&agrave;i tự nhi&ecirc;n. Chưa dừng lại ở đ&oacute;, c&ocirc;ng ty c&ograve;n sử dụng những trang thiết bị, d&acirc;y chuyền chiết xuất ph&acirc;n tử v&ocirc; c&ugrave;ng hiện đại đến từ H&agrave;n Quốc để sản phẩm c&oacute; độ h&ograve;a tan v&agrave; thẩm thấu nhanh, gi&uacute;p đem lại hiệu quả tối ưu khi sử dụng cho kh&aacute;ch h&agrave;ng.</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cao-Nam-Trung-Thao-MHD-Pharma-2\" src=\"http://greenliving.vip/storage/products/April2019/Cao-Nam-Trung-Thao-MHD-Pharma-2.jpg\" alt=\"Cao-Nam-Trung-Thao-MHD-Pharma-2\" width=\"750\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><em>C&ocirc;ng nghệ sản xuất cải tiến c&ugrave;ng d&acirc;y chuyền sản xuất hiện đại gi&uacute;p mang đến sản phẩm lu&ocirc;n đạt chất lượng tốt nhất.</em></p>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">H&atilde;y c&ugrave;ng lắng nghe một v&agrave;i &yacute; kiến của người sử dụng để kiểm chứng về chất lượng m&agrave; sản phẩm Cordy-X của <a href=\"http://greenliving.vip\">MHD Pharma</a> mang lại.</p>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Anh Nguyễn Văn Sơn: &ldquo;Trước đ&acirc;y T&ocirc;i thường xuy&ecirc;n bị mất ngủ, ngủ chập chờn kh&ocirc;ng ngon giấc l&agrave;m ảnh hưởng đến c&ocirc;ng việc rất nhiều. T&ocirc;i đ&atilde; sử dụng qua rất nhiều sản phẩm kh&aacute;c những vẫn kh&ocirc;ng thấy cải thiện. Từ khi d&ugrave;ng sản phẩm Cao Nấm Tr&ugrave;ng Thảo CORDY &ndash; X t&ocirc;i thấy ăn ngon, ngủ được, tinh thần minh mẫn hẳn ra. T&ocirc;i sẽ tiếp tục sử dụng sản phẩm.&rdquo;</p>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Chị Trương B&ugrave;i Nhi: &ldquo;Người nh&agrave; t&ocirc;i vừa trải qua ca mổ, sức khoẻ suy giảm hẳn, ăn kh&ocirc;ng ngon n&ecirc;n sức khoẻ ng&agrave;y c&agrave;ng suy kiệt. T&ocirc;i được bạn b&egrave; giới thiệu sản phẩm <a href=\"http://greenliving.vip/san-pham\">Cao Nấm Tr&ugrave;ng Thảo CORDY &ndash; X</a> v&agrave; mua cho người nh&agrave; d&ugrave;ng thử. Sau khi d&ugrave;ng khoảng 1 tuần, người nh&agrave; t&ocirc;i sức khoẻ phục hồi r&otilde; rệt, ăn uống cũng ngon miệng hơn n&ecirc;n da dẻ bắt đầu hồng h&agrave;o trở lại, cả nh&agrave; t&ocirc;i ai nấy cũng mừng. Gia đ&igrave;nh t&ocirc;i sẽ tiếp tục sử dụng sản phẩm&rdquo;.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"justify\"><em><strong>Lee</strong></em></p>','products/April2019/kC46FvwBdo2P7lsGC8wA.jpg','cao-nam-trung-thao-cordy-x-cua-mhd-pharma-co-gi-dac-biet','1','Brand','2019-04-04 03:32:07','2019-04-12 04:07:13',NULL,NULL,NULL,NULL),(15,'Cao Nấm Trùng Thảo Cordy - X là gì?',3,'Cao nấm trùng thảo Cordy – X một cái tên nghe có vẻ rất lạ đúng không? Thế nên, hôm nay MHD Pharma sẽ chia sẽ về loại cao này để các bạn hiểu rõ hơn về nó nhé.',NULL,'<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Về Cao Nấm Tr&ugrave;ng Thảo Cordy-X</strong></h3>\r\n<p>Chắc hẳn bạn đ&atilde; qu&aacute; quen thuộc với hai c&aacute;i t&ecirc;n &ldquo;Đ&ocirc;ng tr&ugrave;ng hạ Thảo&rdquo; v&agrave; &ldquo;Nấm Linh chi&rdquo; rồi đ&uacute;ng kh&ocirc;ng v&agrave; cũng kh&ocirc;ng thể phủ nhận c&ocirc;ng dụng tuyệt vời đối với sức khỏe từ hai loại thảo dược n&agrave;y. V&igrave; thế, MHD Pharma đ&atilde; cho ra đời một sản phẩm với sự kết hợp những điều tuyệt vời nhất từ hai dược liệu n&agrave;y. Vậy sự kết hợp n&agrave;y như thế n&agrave;o? M&igrave;nh c&ugrave;ng t&igrave;m hiểu nh&eacute;.</p>\r\n<p>Đ&ocirc;ng tr&ugrave;ng hạ thảo sau khi được nu&ocirc;i cấy trong điều kiện ti&ecirc;u chuẩn nghi&ecirc;m khắc sẽ được chiết xuất bằng cồn thực phẩm với c&ocirc;ng nghệ chiết xuất lạnh hiện đại từ H&agrave;n Quốc gi&uacute;p giữ nguy&ecirc;n h&agrave;m lượng dược chất vừa gi&uacute;p cơ thể dễ d&agrave;ng hấp thu. Sau đ&oacute; được tinh chế th&agrave;nh tinh chất cao đặc. Mỗi lọ chứa 1,25 g tinh chất Đ&ocirc;ng tr&ugrave;ng hạ thảo cần 7,5 kg Đ&ocirc;ng tr&ugrave;ng hạ thảo tươi.</p>\r\n<p>Nấm Linh Chi cũng được chiếc xuất từ quả thể Nấm linh chi th&ocirc;ng qua quy tr&igrave;nh kiểm tra đầu v&agrave;o chất lượng Nấm đạt ti&ecirc;u chuẩn quốc tế, cho ra tinh chất cao đặc giữ nguy&ecirc;n h&agrave;m lược dược chất. Mỗi lọ chứa 12,50 g tinh chất Nấm linh chi cần đến 0,5 kg Nấm linh chi kh&ocirc;.</p>\r\n<p><strong>Cao nấm tr&ugrave;ng thảo cordy-X</strong>&nbsp;l&agrave; một sản phẩm kết hợp từ những tinh t&uacute;y nhất của hai &ldquo;Ti&ecirc;n dược&rdquo;, để c&oacute; thể gửi đến Bạn một lọ Cao chất lượng l&agrave; cả một qu&aacute; tr&igrave;nh nghi&ecirc;n cứu từ c&aacute;c nh&agrave; nghi&ecirc;n cứu h&agrave;ng đầu Việt Nam.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Sự kh&aacute;c biệt của Cao Nấm tr&ugrave;ng thảo Cordy-X đến từ MHD PHARMA</strong></h3>\r\n<p>Song song với những c&ocirc;ng tr&igrave;nh ph&aacute;t triển của c&ocirc;ng nghệ, b&ecirc;n cạnh đ&oacute; c&aacute;c lại vi khuẩn c&oacute; hại cũng ng&agrave;y c&agrave;ng th&ocirc;ng minh hơn, để th&iacute;ch nghi với m&ocirc;i trường sống. Ch&iacute;nh v&igrave; thế, xuất ph&aacute;t từ những b&acirc;n khu&acirc;n lo lắng cho sức khỏe chung của cộng đồng m&agrave; đội ngũ nghi&ecirc;n cứu của MHD Pharma đ&atilde; ấp ủ giấc mơ được chung tay cải thiện v&agrave; bảo vệ sức khỏe cho c&ocirc;ng đồng.</p>\r\n<p>Sự kh&aacute;c biệt về c&ocirc;ng nghệ, lựa chọn v&agrave; s&agrave;n lọc để cho ra những sản phẩm nấm linh chi v&agrave; <a href=\"http://greenliving.vip/san-pham\">đ&ocirc;ng tr&ugrave;ng hạ thảo</a> đạt chuẩn về nu&ocirc;i cấy lẫn c&aacute;ch thức chế tạo. N&oacute;i kh&ocirc;ng tuyệt đối với thuốc bảo vệ thực vật v&agrave; thuốc tăng trưởng.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cao-nam--trung-thao-cordy-x-1\" src=\"http://greenliving.vip/storage/products/April2019/Dong-trung-ha-thao-cordy-x-gioi-thieu-2.png\" alt=\"Cao-nam--trung-thao-cordy-x-1\" width=\"500\" /></p>\r\n<p style=\"text-align: center;\"><em>Cao nấm tr&ugrave;ng thảo Cordy - X MHD Pharma.</em></p>\r\n<p>Nu&ocirc;i trồng trong điều kiện &aacute;nh s&aacute;ng ti&ecirc;u chuẩn, nấm trong qu&aacute; tr&igrave;nh sinh trưởng đều được theo d&otilde;i, chăm s&oacute;c từng li, để nấm đạt được chất lượng ho&agrave;n hảo nhất.</p>\r\n<p>C&ocirc;ng nghệ tinh chế ra sản phẩm cuối đến tay người ti&ecirc;u d&ugrave;ng lu&ocirc;n đảm bảo về chất lượng, từ kh&acirc;u v&ocirc; trung, đến kh&acirc;u đ&oacute;ng g&oacute;i. Thật sự, khi tạo ra một sản phẩm mang t&iacute;nh chất &yacute; nghĩa về sức khỏe thật sự kh&ocirc;ng dễ d&agrave;ng ch&uacute;t n&agrave;o. Nhưng xuất ph&aacute;t từ tr&aacute;i tim, <a href=\"http://greenliving.vip/gioi-thieu\">MHD pharma</a> đ&atilde; mang đến một sản phẩm kh&ocirc;ng chỉ tốt cho sức khỏe m&agrave; c&ograve;n mang gi&aacute; trị về cộng đồng</p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/April2019/pZebbN7Qh1nh6S9zdqC8.jpg','cao-nam-trung-thao-cordy-x-la-gi','1','Brand','2019-04-04 03:19:39','2019-04-12 04:31:11',NULL,NULL,NULL,NULL),(16,'Công dụng của Cao Nấm Trùng Thảo Cordy - X',3,'Cao nấm trùng thảo cordy-X không phải ngẫu nhiên mà có được tác dụng ưu việt đến thế. Tác dụng ấy được thể hiện qua cách dùng và tính năng vượt trội của hai loại thảo dược quý.',NULL,'<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Cao nấm tr&ugrave;ng thảo cordy-X c&oacute; t&aacute;c dụng như thế n&agrave;o?&nbsp;</strong></h3>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; vertical-align: baseline;\" align=\"justify\">Mang trong m&igrave;nh nhiều kho&aacute;ng chất v&agrave; c&aacute;c chất dinh dưỡng tuyệt vời. <a href=\"http://greenliving.vip/san-pham\">Cao nấm tr&ugrave;ng thảo Cordy-X</a> thật sự tốt trong việc bồi bổ sức khỏe, gi&uacute;p tăng sức dề kh&aacute;ng đối với c&aacute;c bạn n&agrave;o vừa mới hết bệnh hay cơ địa vốn dĩ kh&ocirc;ng sản sinh ra sức đề kh&aacute;ng. B&ecirc;n cạnh đ&oacute;, với những bạn n&agrave;o l&agrave;m việc hay căng thẳng mệt mỏi, th&igrave; việc d&ugrave;ng một &iacute;t cao nấm tr&ugrave;ng thảo v&agrave;o buổi s&aacute;ng sẽ gi&uacute;p cơ thể hấp thụ nhiều kho&aacute;ng chất, giảm căng thẳng mệt mỏi. Nếu bạn c&oacute; triệu chứng mất ngủ th&igrave; d&ugrave;ng trước 5p sẽ gi&uacute;p bạn c&oacute; một giấc ngủ s&acirc;u v&agrave; ngon giấc hơn.&nbsp;Đặc biệt, cao nấm tr&ugrave;ng thảo c&ograve;n c&oacute; khả năng giảm cholesterol trong cơ thể, gi&uacute;p ph&ograve;ng ngừa c&aacute;c bệnh về tim mạch rất tốt.&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph; vertical-align: baseline;\" align=\"justify\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cong-dung-cua-cao-nam-trung-thao\" src=\"http://greenliving.vip/storage/products/April2019/Cong-dung-cua-cao-nam-trung-thao-1.jpg\" alt=\"Cong-dung-cua-cao-nam-trung-thao\" width=\"750\" height=\"500\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\"><em>C&ocirc;ng nghệ </em><em>sản xuất lạnh v&agrave; tiệt tr&ugrave;ng nghi&ecirc;m ngặc.</em></p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\">C&aacute;ch sử dụng Cao nấm tr&ugrave;ng thảo Cordy-X</h3>\r\n<p class=\"MsoNormal\">Cao nấm tr&ugrave;ng thảo Cordy-X c&oacute; 2 c&aacute;nh sử dụng ch&iacute;nh. Đ&oacute; l&agrave; bạn c&oacute; thể ngậm trực tiếp cao, để cao tan dần v&agrave; lan tỏa vị thơm của cao. Nếu bạn c&oacute; nhiều thời gian hơn, th&igrave; c&oacute; thể pha cao với nước ấm, h&ograve;a tan v&agrave; thưởng thức như một t&aacute;ch tr&agrave; v&agrave;o buổi s&aacute;ng sớm. Mỗi ng&agrave;y, m&igrave;nh sẽ sử dụng 1 đến 2 lần, lưu &yacute; l&agrave; trước bữa ăn 30p nh&eacute;. C&aacute;c bạn y&ecirc;n t&acirc;m về việc, cao sẽ kh&oacute; tan hay mất dưỡng chất v&igrave; d&acirc;y chuyền chiết xuất PH&Acirc;N TỬ hiện đại đến từ H&agrave;n Quốc sẽ gi&uacute;p sản phẩm c&oacute; độ h&ograve;a tan cao v&agrave; thẩm thấu v&agrave;o cơ thể nhanh hơn.</p>\r\n<p class=\"MsoNormal\"><strong>Cao Nấm TR&ugrave;ng Thảo CORDY&ndash;X</strong><strong>&nbsp;</strong>th&iacute;ch hợp cho c&aacute;c đối tượng l&agrave; nh&acirc;n vi&ecirc;n văn ph&ograve;ng, thường hay căng thẳng v&igrave; c&ocirc;ng việc bận rộn, &iacute;t vận động, sức đề kh&aacute;ng yếu, bị rối loạn giấc ngủ do &aacute;p lực c&ocirc;ng việc hay người mất ngủ do bệnh l&yacute;. Đặc biệt, l&agrave; c&aacute;c đối tượng đang điều trị hoặc sau điều trị h&oacute;a trị hay xạ trị.&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/April2019/IYEIoBikENl6xVhWPbpn.png','cong-dung-cua-cao-nam-trung-thao-cordy-x','1','Brand','2019-04-04 04:32:20','2019-04-12 04:16:56',NULL,NULL,NULL,NULL),(17,'Cải thiện làn da từ bên trong',3,'Đã bao giờ các bạn lắng nghe làn da mình lên tiếng chưa? Nghe có vẻ lạ, nhưng những gì da đang thể hiện là có nguyên nhân. Cùng MHD Pharma tìm hiểu những điều làn da muốn nói nhé.',NULL,'<p>Đ&atilde; bao giờ c&aacute;c bạn lắng nghe l&agrave;n da m&igrave;nh l&ecirc;n tiếng chưa? Nghe c&oacute; vẻ lạ, nhưng những g&igrave; da đang thể hiện l&agrave; c&oacute; nguy&ecirc;n nh&acirc;n. C&ugrave;ng MHD Pharma t&igrave;m hiểu những điều l&agrave;n da muốn n&oacute;i nh&eacute;.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\">B&aacute;o động đỏ về sức khỏe đến từ l&agrave;n da</h3>\r\n<p class=\"15\" style=\"margin-left: 0.0000pt; mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">MHD Pharma n&oacute;i nghe c&aacute;i n&agrave;y n&egrave;! Da l&agrave; lớp ph&ograve;ng vệ cuối c&ugrave;ng của cơ thể khỏi c&aacute;c t&aacute;c nh&acirc;n g&acirc;y hại b&ecirc;n ngo&agrave;i. Điều n&agrave;y c&oacute; nghĩa khi da c&aacute;c bạn xuất hiện những nếp nhăn, mụn hay nổi mẩn đỏ. Đ&oacute; ch&iacute;nh l&agrave; l&uacute;c l&agrave;n da đang l&ecirc;n tiếng, v&agrave; cần được cải thiện từ b&ecirc;n ngo&agrave;i lẫn b&ecirc;n trong cơ thể.</p>\r\n<p class=\"MsoNormal\">V&iacute; dụ: khi bạn bị stress, căng thẳng qu&aacute; độ, da sẽ xuất hiện nếp nhăn. Cơ thể kh&ocirc;ng đủ nước, da sẽ xuất hiện t&igrave;nh trạng kh&ocirc;, bong da; đặc biệt l&agrave; v&ugrave;ng da m&ocirc;i, v&agrave; t&aacute;c nh&acirc;n mạnh mẽ nhất mất thẩm mỹ nhất đ&oacute; ch&iacute;nh l&agrave; MỤN.&nbsp;Thế n&ecirc;n, đừng để c&aacute;c t&igrave;nh trạng n&agrave;y k&eacute;o d&agrave;i, m&agrave; khi n&oacute; mới ở mức b&aacute;o động th&ocirc;i th&igrave; phải t&igrave;m ngay c&aacute;ch để <strong>cải thiện l&agrave;n da </strong>nh&eacute;.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>L&agrave;m thế n&agrave;o để cải thiện l&agrave;n da từ b&ecirc;n trong c&ugrave;ng MHD Pharma</strong></h3>\r\n<p class=\"MsoNormal\">L&agrave;n da chỉ rạng ngời bền vững khi cơ thể thật sự khỏe mạnh từ b&ecirc;n trong. Do đ&oacute;, b&ecirc;n cạnh c&aacute;c h&igrave;nh thức bảo vệ từ b&ecirc;n ngo&agrave;i, c&aacute;c bạn cũng cần chăm s&oacute;c&nbsp;cấu tr&uacute;c nền cũng như hỗ trợ &ldquo;hệ trục v&agrave;ng&rdquo; l&agrave; &ldquo;n&atilde;o bộ - tuyến y&ecirc;n - buồng trứng&rdquo; hoạt động tốt ngay khi bước qua tuổi 30.</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cai-thien-lan-da-tu-ben-trong-1\" src=\"http://greenliving.vip/storage/products/April2019/cai-thien-lan-da-mun-1.jpg\" alt=\"Cai-thien-lan-da-tu-ben-trong-1\" width=\"750\" height=\"500\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Lắng nghe l&agrave;n da từ b&ecirc;n trong. (<em>Ảnh: dantri</em>)</p>\r\n<p class=\"MsoNormal\">Khoa học hiện đại ng&agrave;y c&agrave;ng c&oacute; những bước ph&aacute;t triển để t&igrave;m ra c&aacute;c giải ph&aacute;p l&agrave;m chậm l&atilde;o h&oacute;a, duy tr&igrave; sự tươi trẻ của l&agrave;n da cũng như bảo vệ sức khỏe to&agrave;n th&acirc;n. Hiện nay, trong khi thảo dược truyền thống d&agrave;nh ri&ecirc;ng cho ph&aacute;i đẹp như nh&acirc;n s&acirc;m hay tổ yến đ&atilde; qu&aacute; quen thuộc trong việc cải thiện l&agrave;n da, th&igrave; b&ecirc;n cạnh đ&oacute; <a href=\"http://greenliving.vip/san-pham\">Cao Nấm Tr&ugrave;ng Thảo CORDY &ndash; X</a> đang l&agrave; sự lựa chọn để bảo vệ v&agrave; cải thiện da từ b&ecirc;n trong v&ocirc; c&ugrave;ng xuất sắc lu&ocirc;n nh&eacute;.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/April2019/WMX0vev87nn7y5GQizvd.jpg','cai-thien-lan-da-tu-ben-trong','1','Health tips','2019-04-04 05:01:45','2019-04-12 04:06:00',NULL,NULL,NULL,NULL),(18,'Những cô nàng độc thân quyến rũ',3,'Cuộc sống “ĐỘC THÂN” tẻ nhạt và buồn chán lắm ư? Không hề đâu nhé, hỡi các cô nàng đang ngồi than thở ngoài kia, hãy cùng MHD Pharma khám phá cuộc sống “ĐỘC THÂN” tràn đầy sức sống nào.',NULL,'<p>Cuộc sống &ldquo;ĐỘC TH&Acirc;N&rdquo; tẻ nhạt v&agrave; buồn ch&aacute;n lắm ư? Kh&ocirc;ng hề đ&acirc;u nh&eacute;, hỡi c&aacute;c c&ocirc; n&agrave;ng đang ngồi than thở ngo&agrave;i kia, h&atilde;y c&ugrave;ng MHD Pharma kh&aacute;m ph&aacute; cuộc sống &ldquo;ĐỘC TH&Acirc;N&rdquo; tr&agrave;n đầy sức sống n&agrave;o.&nbsp;</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Buổi s&aacute;ng c&ugrave;ng c&ocirc; n&agrave;ng &ldquo;Độc th&acirc;n năng lượng&rdquo;</strong></h3>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">Kh&ocirc;ng c&oacute; g&igrave; quan trọng bằng việc tự cung cấp cho m&igrave;nh một nguồn năng lượng t&iacute;ch cực,v&igrave; thế buổi s&aacute;ng sẽ l&agrave; thời gian ho&agrave;n hảo nhất, để c&aacute;c c&ocirc; n&agrave;ng độc th&acirc;n thu nạp nguồn năng lượng ấy bằng việc</p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\"><!-- [if !supportLists]-->Thức dậy sớm, h&iacute;t thở kh&ocirc;ng kh&iacute; trong l&agrave;nh, tập yoga hay những b&agrave;i thể dục nhẹ để n&acirc;ng cao thể chất v&agrave; thưởng thức một t&aacute;ch caf&eacute; nơi g&oacute;c phố nhỏ. E h&egrave;m!!! Lưu &yacute; c&aacute;i n&agrave;y d&agrave;nh cho những c&ocirc; n&agrave;ng kh&ocirc;ng lười th&ocirc;i nha.</li>\r\n<li class=\"MsoNormal\">Với c&ocirc; n&agrave;ng bận rộn, th&igrave; đừng n&ecirc;n bỏ bữa s&aacute;ng v&igrave; n&oacute; sẽ khiến bạn kh&ocirc;ng c&oacute; đủ năng lượng cho một ng&agrave;y d&agrave;i l&agrave;m việc.</li>\r\n</ul>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Buổi Trưa c&ugrave;ng c&ocirc; n&agrave;ng &ldquo;Độc th&acirc;n tinh tế&rdquo;&nbsp;</strong></h3>\r\n<p class=\"MsoNormal\">Trưa sẽ l&agrave; khoảng thời gian c&aacute;c c&ocirc; n&agrave;ng lựa chọn m&oacute;n ăn sao cho thật tinh tế, để giữ vững nguồn năng lượng từ buổi s&aacute;ng. Thực đơn kh&ocirc;ng cần qu&aacute; cầu k&igrave;, chỉ cần đảm bảo đầy đủ dưỡng chất thiết yếu th&ocirc;i.Tr&aacute;nh những thực phẩm nhiều dầu mỡ sẽ dễ l&ecirc;n mụn v&agrave; đặc biệt phải uống đủ nước.</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nhung-co-nang-doc-than-quyen-ru-2\" src=\"http://greenliving.vip/storage/products/April2019/Nhung-co-nang-doc-than-quyen-ru-2.png\" alt=\"Nhung-co-nang-doc-than-quyen-ru-2\" width=\"750\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Tr&aacute;nh những thức ăn chứa nhiều dầu mỡ. (<em>Ảnh: gramcik</em>)</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Buổi Chiều c&ugrave;ng c&ocirc; n&agrave;ng &ldquo;Độc th&acirc;n m&agrave;u sắc&rdquo;&nbsp;</strong></h3>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">&ldquo;Cứ đến chiều l&agrave; <a href=\"http://greenliving.vip/tin-tuc-va-su-kien?cai-thien-lan-da-tu-ben-trong\">l&agrave;n da</a> sạm hẳn, kh&ocirc;ng c&ograve;n tươi như buổi sớm mai?&rdquo; đ&oacute; l&agrave; v&igrave; c&aacute;c nguy&ecirc;n nh&acirc;n:</p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\">Sau một ng&agrave;y hoạt động, nếu kh&ocirc;ng bổ sung cho cơ thể những dưỡng chất thiết yếu, da sẽ rất dễ sạm v&agrave; đặc biệt tr&ocirc;ng rất thiếu sức sống.</li>\r\n<li class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\">Kh&ocirc;ng cung cấp đủ nước cho cơ thể.</li>\r\n</ul>\r\n<p class=\"MsoNormal\">Một điều quan trọng l&agrave; &ldquo;Đừng để phai m&agrave;u makeup&rdquo;. T&ocirc; lại t&iacute; son th&ocirc;i l&agrave; đủ rồi.</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Cai-thien-lan-da-tu-ben-trong-2\" src=\"http://greenliving.vip/storage/products/April2019/Cai-thien-lan-da-tu-ben-trong-2.jpg\" alt=\"Cai-thien-lan-da-tu-ben-trong-2\" width=\"750\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Sự tươi trẻ đến từ l&agrave;n da.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Buổi tối c&ugrave;ng c&ocirc; n&agrave;ng &ldquo;Độc th&acirc;n quyến rũ&rdquo;&nbsp;</strong></h3>\r\n<p class=\"MsoNormal\" style=\"mso-pagination: none; text-align: justify; text-justify: inter-ideograph;\" align=\"justify\">H&atilde;y trở n&ecirc;n quyến rũ bằng việc tạo cho m&igrave;nh một phong c&aacute;ch sống thật khỏe mạnh v&agrave; hiểu được những g&igrave; cơ thể m&igrave;nh muốn n&oacute;i. Buổi tối sẽ l&agrave; thời điểm m&agrave; cơ thể cần được thư gi&atilde;n. C&aacute;c c&ocirc; n&agrave;ng, n&ecirc;n kh&eacute;p lại c&ocirc;ng việc v&agrave; chia sẽ những điều l&agrave;m bạn đau đầu c&ugrave;ng nh&oacute;m bạn th&acirc;n v&igrave; đ&ocirc;i khi bạn sẽ cần một lời khuy&ecirc;n từ ai đ&oacute;.</p>\r\n<p class=\"MsoNormal\">Con g&aacute;i độc th&acirc;n kh&ocirc;ng buồn tẻ đ&acirc;u nh&eacute;. Ngo&agrave;i những việc m&agrave; c&aacute;c c&ocirc; n&agrave;ng n&ecirc;n l&agrave;m th&igrave; việc t&igrave;m cho m&igrave;nh một loại&nbsp;thảo&nbsp;dược bổ sung năng lương cho cơ thể l&agrave; kh&ocirc;ng thể thiếu. V&iacute; dụ như những&nbsp;thảo&nbsp;dược tốt cho da, trong đ&oacute; c&aacute;c c&ocirc; n&agrave;ng đ&atilde; biết đến đ&ocirc;ng tr&ugrave;ng hạ thảo chưa? Nếu c&aacute;c c&ocirc; n&agrave;ng c&ograve;n lăn&nbsp;tăn&nbsp;chưa hiểu th&igrave; n&ecirc;n t&igrave;m hiểu ngay tại <a href=\"http://greenliving.vip\">MHD Pharma</a>&nbsp;nha.</p>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Nhung-co-nang-doc-than-quyen-ru-4\" src=\"http://greenliving.vip/storage/products/April2019/Nhung-co-nang-doc-than-quyen-ru-4.png\" alt=\"Nhung-co-nang-doc-than-quyen-ru-4\" width=\"750\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Độc th&acirc;n quyến rũ.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/June2019/4RfniKLMElaFPt311pey.png','nhung-co-nang-doc-than-quyen-r','1','Lifestyle','2019-04-04 06:20:12','2019-06-11 21:42:48',NULL,NULL,NULL,NULL),(19,'Lựa chọn của phụ nữ hiện đại',3,'Điều thiết yếu nhất của một người phụ nữ hiện đại là nên biết cách tự chăm sóc bản thân, chủ động về tài chính và đặc biệt là phải quyết đoán. Hãy cùng MHD Pharma trải nghiệm điều này nhé.',NULL,'<p>Điều thiết yếu nhất của một người phụ nữ hiện đại l&agrave; n&ecirc;n biết c&aacute;ch tự chăm s&oacute;c bản th&acirc;n, chủ động về t&agrave;i ch&iacute;nh v&agrave; đặc biệt l&agrave; phải quyết đo&aacute;n. H&atilde;y c&ugrave;ng MHD Pharma trải nghiệm điều n&agrave;y nh&eacute;.</p>\r\n<h3 class=\"MsoNormal\" style=\"margin-top: 1px;\"><strong>Xu hướng sống của Phụ nữ hiện đại</strong></h3>\r\n<p class=\"MsoNormal\">Định nghĩa về một người <strong>phụ nữ hiện đại</strong>&nbsp;thật sự rất mong lung v&agrave; lạ lẫm. Nhưng đối với những d&ograve;ng chia sẻ của c&aacute;c c&ocirc; n&agrave;ng Paris trong cuốn cẩm nang &rdquo;Sống như ng