kh&ocirc;ng chất l&agrave;m đặc.</li>\r\n<li class=\"MsoNormal\">Sản Xuất: D&acirc;y truyền chuẩn GMP. Kh&ocirc;ng chất tạo m&agrave;u, kh&ocirc;ng chất bảo quản.</li>\r\n</ul>\r\n<p class=\"MsoNormal\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Dong-trung-ha-thao-cordy-x\" src=\"http://greenliving.vip/storage/products/April2019/Dong-trung-ha-thao-cordy-x-gioi-thieu1.png\" alt=\"Dong-trung-ha-thao-cordy-x\" width=\"750\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\">Cao Nấm Tr&ugrave;ng Thảo Cordy - X bảo vệ bạn tận t&acirc;m.</p>','products/June2019/z3fRHRpEXtih9NFBQlG1.gif','cao-nam-trung-thao-cordy-x-khong-chat-bao-quan-khong-chat-tao-mau',NULL,'Healthy','2019-04-10 02:44:08','2019-06-11 21:22:01',NULL,NULL,NULL,NULL),(25,'Sống khoẻ ăn ngon cho bệnh nhân tim mạch',3,'Có khi nào bạn nghe trái tim mình kêu gọi những cơn đau chưa, cho dù chỉ thoáng qua thôi nhé? Vì thế hôm nay, MHD Pharma sẽ cùng bạn tìm hiểu về cách “sống khỏe ăn ngon” để bảo vệ trái tim của mình.',NULL,'<p>C&oacute; khi n&agrave;o bạn nghe tr&aacute;i tim m&igrave;nh k&ecirc;u gọi những cơn đau chưa, cho d&ugrave; chỉ tho&aacute;ng qua th&ocirc;i nh&eacute;? V&igrave; thế h&ocirc;m nay, <a href=\"http://greenliving.vip\">MHD Pharma</a> sẽ c&ugrave;ng bạn t&igrave;m hiểu về c&aacute;ch &ldquo;sống khỏe ăn ngon&rdquo; để bảo vệ tr&aacute;i tim của m&igrave;nh.&nbsp;</p>\r\n<h3 style=\"margin-top: 1px;\"><strong>Nguy&ecirc;n nh&acirc;n dẫn đến bệnh tim mạch</strong></h3>\r\n<p>Choslesterol l&agrave; nguy&ecirc;n nh&acirc;n ch&iacute;nh ảnh hưởng rất lớn đến tr&aacute;i tim của ch&uacute;ng ta. Khi cholesterol trong m&aacute;u l&ecirc;n qu&aacute; cao, ch&uacute;ng sẽ b&aacute;m v&agrave;o th&agrave;nh động mạch v&agrave;nh, l&agrave;m th&agrave;nh mạch hẹp lại, g&acirc;y cản trở lưu th&ocirc;ng m&aacute;u v&agrave; l&agrave;m giảm lưu lượng m&aacute;u đến nu&ocirc;i c&aacute;c cơ quan v&agrave; tổ chức trong cơ thể, dẫn đến thiếu m&aacute;u cơ tim cũng như thiếu m&aacute;u nu&ocirc;i c&aacute;c cơ quan tổ chức kh&aacute;c.</p>\r\n<p>Cao huyết &aacute;p, đ&acirc;y l&agrave; một bệnh l&yacute; kh&aacute; phổ biến hiện nay v&agrave; ngay cả những người chưa đến 40 tuổi cũng l&agrave; nạn nh&acirc;n của căn bệnh n&agrave;y. Khi huyết &aacute;p tăng đột ngột sẽ dẫn đến việc tim phải chịu một khối lượng c&ocirc;ng việc kh&aacute; lớn l&agrave; cố gắng co b&oacute;p nhiều hơn để đưa m&aacute;u đến nu&ocirc;i cơ thể, đặc biệt l&agrave; với trường hợp khi động mạch v&agrave;nh tắc nghẽn v&agrave; kh&ocirc;ng cung cấp đủ oxy v&agrave; c&aacute;c chất dinh dưỡng th&igrave; tim lại c&agrave;ng phải hoạt động nhiều hơn b&igrave;nh thường gắp hai lần.&nbsp;</p>\r\n<p>Bệnh tiểu đường cũng rất nguy hiểm đến tim của ch&uacute;ng ta, bệnh tiểu đường l&agrave;m tăng nguy cơ bệnh mạch v&agrave;nh l&ecirc;n gấp 1,8 lần. H&uacute;t thuốc l&aacute;, sử dụng c&aacute;c chất k&iacute;ch th&iacute;ch như rượu bia cũng sẽ dẫn đến c&aacute;c bệnh l&yacute; về tim mạch như suy tim do tăng lượng chất b&eacute;o triglyceride, giảm c&aacute;c chất b&eacute;o tốt như HDL v&agrave; g&acirc;y xơ vữa động mạch.&nbsp;</p>\r\n<h3 style=\"margin-top: 1px;\">Chế độ &ldquo;Sống khỏe ăn ngon&rdquo; tốt cho tim mạch&nbsp;</h3>\r\n<p>Để hạn chế việc tăng cholesterol, c&aacute;c bạn n&ecirc;n bổ sung chất xơ, vitamin v&agrave; kho&aacute;ng chất cần thiết cho cơ thể. Chất xơ bạn c&oacute; thể t&igrave;m thấy n&oacute; trong c&aacute;c loại rau củ quả v&agrave; những loại ngũ cốt th&ocirc; như: gạo lức,c&aacute;c loại đậu c&oacute; t&aacute;c dụng chuyển h&oacute;a c&aacute;c chất b&eacute;o v&agrave; l&agrave;m hạ huyết &aacute;p. C&aacute;c loại rau củ v&agrave; tr&aacute;i c&acirc;y sẽ bổ sung flavonoid l&agrave; dưỡng chất c&oacute; lợi cho sức khỏe, c&aacute;c chất n&agrave;y hoạt động như c&aacute;c chất chống oxi h&oacute;a v&agrave; c&oacute; thể giảm nguy cơ vi&ecirc;m nhiễm, ngăn ngừa bệnh tim mạch. Ngo&agrave;i ra, c&aacute;c bạn c&ograve;n cần phải hạn chết bổ sung mỡ động vật, hạn chế ăn mặn v&agrave; ngọt, uống đủ nước m&agrave; cơ thể cần, đặt biệt phải c&aacute;c bạn phải tập thể dục vừa đủ, để n&acirc;ng cao thể chất,một số hoạt chất trong thức ăn chỉ bị đ&aacute;nh thức khi chung ta hoạt động cơ thể cũng như l&agrave; tiếp x&uacute;c với &aacute;nh nắng mặt trời. V&igrave; thế, một ch&uacute;t vận động l&agrave; kh&ocirc;ng thể thiếu đ&acirc;u nh&eacute;.&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"bo-sung-dinh-duong\" src=\"http://greenliving.vip/storage/products/April2019/bo-sung-dinh-duong-1.png\" alt=\"bo-sung-dinh-duong\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Cao Nấm Tr&ugrave;ng Thảo Cordy-X.</p>\r\n<h3 style=\"margin-top: 1px;\"><strong>Sống khỏe ăn ngon để bảo về tr&aacute;i tim của bạn&nbsp;</strong></h3>\r\n<p>Đừng bao giờ ngủ qu&ecirc;n trong việc &ldquo;m&igrave;nh rất khỏe v&agrave; kh&ocirc;ng cần bảo vệ&rdquo;. Điều n&agrave;y ho&agrave;n to&agrave;n sai lầm, mỗi ng&agrave;y ch&uacute;ng ta đều cần phải cung cấp rất nhiều chất dinh dưỡng, để nu&ocirc;i c&aacute;c cơ quan tổ chức v&agrave; đủ để c&oacute; năng lượng mỗi ng&agrave;y l&agrave;m việc, thế n&ecirc;n việc lựa chọn cho m&igrave;nh một cuộc sống khỏe mạnh l&agrave; kh&ocirc;ng thể bỏ qua.&nbsp;</p>\r\n<p>Nhưng đ&acirc;u đ&oacute;, c&aacute;c bạn lại nghĩ rằng, ăn uống qu&aacute; nhạt, hay qu&aacute; &ldquo;healthy&rdquo; sẽ l&agrave;m mất hương vị của cuộc sống. C&aacute;c bạn h&atilde;y y&ecirc;n t&acirc;m, chỉ cần ch&uacute;ng ta biết c&aacute;ch lựa chọn những thực phẩm sạch, tươi sống v&agrave; đảm bảo được chất lượng đầu ra của sản phẩm th&igrave; hiển nhi&ecirc;n kh&ocirc;ng cần n&ecirc;m g&igrave; cả bạn cũng sẽ c&oacute; được cả một bầu trời hương vị m&agrave; vẫn an to&agrave;n cho sức khỏe.&nbsp;</p>\r\n<p>Song song đ&oacute;, c&aacute;c bạn đừng qu&ecirc;n rằng, Cao Nấm Tr&ugrave;ng Thảo Cordy-X cũng l&agrave; một loại Thực Phẩm Bảo Vệ Sức Khỏe, k&iacute;ch th&iacute;ch vị gi&aacute;c của bạn. Mỗi buổi s&aacute;ng, chỉ cần bạn ngậm một &iacute;t cao, để tan v&agrave; thẩm thấu từ từ, bạn sẽ thấy được điều diệu k&igrave; của Cao Nấm Tr&ugrave;ng Thảo Cordy-X mang lại, từng tế b&agrave;o vị gi&aacute;c dường như được đ&aacute;nh thức sau một đ&ecirc;m ngon giấc. H&atilde;y trải nghiệm điều n&agrave;y c&ugrave;ng MHD Pharma nha.&nbsp;&nbsp;</p>\r\n<p style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/June2019/oKLVzezfYzo3eiAbZ2qK.png','song-khoe-n-ngon-cho-benh-nhan-tim-mach',NULL,'Healthy','2019-04-11 06:45:15','2019-06-11 21:40:49',NULL,NULL,NULL,NULL),(28,'3 Cách bổ sung sức khoẻ cho bệnh nhân tim mạch',8,'Mỗi chúng ta, ngoài việc tự vận động và truyền cho mình nguồn năng lượng để phục hồi sức khỏe thì bên cạnh đó còn cần phải nhờ sự tác động từ bên ngoài. Thế nên hôm nay MHD Pharma sẽ mách bạn một vài cách để bồi bổ sức khỏe cho những bệnh nhân có bệnh lý về tim mạch.',NULL,'<p>Mỗi ch&uacute;ng ta, ngo&agrave;i việc tự vận động v&agrave; truyền cho m&igrave;nh nguồn năng lượng để phục hồi sức khỏe th&igrave; b&ecirc;n cạnh đ&oacute; c&ograve;n cần phải nhờ sự t&aacute;c động từ b&ecirc;n ngo&agrave;i. Thế n&ecirc;n h&ocirc;m nay MHD Pharma sẽ m&aacute;ch bạn một v&agrave;i c&aacute;ch để bồi bổ sức khỏe cho những bệnh nh&acirc;n c&oacute; bệnh l&yacute; về tim mạch.</p>\r\n<h3 style=\"margin-top: 1px;\"><strong>Suy nghĩ chưa đ&uacute;ng về việc bồi bổ sức khỏe cho bệnh nh&acirc;n tim mạch</strong></h3>\r\n<p>Bệnh tim mạch l&agrave; bệnh m&agrave; ảnh hưởng của n&oacute; t&aacute;c động tới chức năng của tim v&agrave; mạch m&aacute;u, g&acirc;y n&ecirc;n những vấn đề rất nghi&ecirc;m trọng về sức khỏe. V&igrave; thế khi ch&uacute;ng ta c&oacute; những triệu chứng bệnh l&yacute; về tim mạch, hiển nhi&ecirc;n cần được chăm s&oacute;c đặc biệt do c&aacute;c bệnh tim mạch thường cấp t&iacute;nh v&agrave; nguy hiểm.</p>\r\n<p>Nhiều trường hợp bệnh nh&acirc;n tim mạch lu&ocirc;n c&oacute; t&acirc;m l&yacute; lo lắng v&igrave; cơ thể m&igrave;nh kh&ocirc;ng khỏe mạnh. Họ chọn c&aacute;ch bảo vệ m&igrave;nh bằng việc ki&ecirc;ng khen qu&aacute; mức trong đ&oacute; c&oacute; việc ăn uống. Song nhiều chuy&ecirc;n gia về tim mạch cho rằng: Người mắc bệnh tim mạch kh&ocirc;ng cần ki&ecirc;ng khen nhiều, chỉ cần điều chỉnh chế độ dinh dưỡng hợp l&yacute;. N&oacute;i một c&aacute;ch kh&aacute;c đi, những người mắc bệnh tim mạch kh&ocirc;ng kh&oacute; để c&oacute; những bữa ăn vừa hợp khẩu vị, vừa g&oacute;p phần bảo vệ được tr&aacute;i tim v&agrave; mạch m&aacute;u của m&igrave;nh.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"benh-tim-mach\" src=\"http://greenliving.vip/storage/products/April2019/Cao-nam-trung-thao-cordy-x-poster.png\" alt=\"benh-tim-mach\" width=\"500\" /></p>\r\n<p style=\"text-align: center;\">Qu&agrave; tặng sức khoẻ cho người th&acirc;n y&ecirc;u nhất.</p>\r\n<h3 style=\"margin-top: 1px;\"><strong>Bệnh nh&acirc;n tim mạch n&ecirc;n bồi bổ như thế n&agrave;o?</strong></h3>\r\n<p>Để xua tan đi nổi lo lắng của c&aacute;c bệnh nhận tim mạch, <a href=\"http://greenliving.vip/thong-tin-can-quan-tam.html\">MHD Pharma</a> sẽ bật m&iacute; với bạn một v&agrave;i c&aacute;ch để c&oacute; thể vừa c&oacute; một chế độ ăn tốt nhưng vẫn rất đậm đ&agrave; hương vị nh&eacute;.&nbsp;</p>\r\n<p>1.&nbsp; &nbsp; Cao Nấm Tr&ugrave;ng Thảo Cordy-X chắc đ&atilde; kh&ocirc;ng c&ograve;n xa lạ với c&aacute;c bạn rồi đ&uacute;ng kh&ocirc;ng? L&yacute; do m&agrave; MHD Pharma n&oacute;i đến sản phẩm n&agrave;y l&agrave; v&igrave; Cao Nấm Tr&ugrave;ng Thảo Cordy-X l&agrave; sản phẩm chứa tinh chất Đ&ocirc;ng Tr&ugrave;ng Hạ Thảo c&oacute; t&aacute;c dụng l&agrave;m gi&atilde;n mạch m&aacute;u, tăng lưu lượng tuần ho&agrave;n n&atilde;o, gi&uacute;p ổn định nhịp tim, điều chỉnh lipid m&aacute;u, giảm cholesterol v&agrave; lipoprotein, hạn chế qu&aacute; tr&igrave;nh tiến triển của t&igrave;nh trạng xơ vữa động mạch. Sản phẩm c&ograve;n gi&uacute;p tăng cường sức đề kh&aacute;ng cũng như tăng khả năng tự hồi phục v&agrave; bồi bộ sức khỏe cho c&aacute;c tế b&agrave;o cơ thể. Ngo&agrave;i ra, Cao Nấm Tr&ugrave;ng Thảo Cordy-X, c&ograve;n c&oacute; khả năng k&iacute;ch th&iacute;ch vị gi&aacute;c, gi&uacute;p c&aacute;c bệnh nh&acirc;n tim mạch d&ugrave;ng bữa trọn vị hơn.</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\">&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"benh-tim-mach\" src=\"http://greenliving.vip/storage/products/April2019/Tang-cuong-rau-cu.png\" alt=\"benh-tim-mach\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Tăng cường rau củ trong mỗi bữa ăn. (<em>Ảnh: vuonthaoduoc</em>)</p>\r\n<p>2. &nbsp;&nbsp;Bổ sung thực phẩm gi&agrave;u kali. Một số trường hợp bệnh l&yacute; về tim nặng c&oacute; thể phải d&ugrave;ng đến thuốc lợi tiểu, l&agrave;m giảm kali m&aacute;u. Khi đ&oacute; việc bổ sung kali trong bệnh tim l&agrave; rất cần thiết. Bạn c&oacute; thể t&igrave;m thấy nguồn kali tuyệt vời ở trong chuối, mận ch&iacute;n, l&ecirc;, cam, nho, c&aacute;c loại rau họ cải (s&uacute;p lơ, cải b&oacute; x&ocirc;i). B&ecirc;n cạnh đ&oacute;, bạn n&ecirc;n lựa chọn đa dạng c&aacute;c thực phẩm tươi, sạch, quan t&acirc;m đến vấn đề vệ sinh an to&agrave;n của c&aacute;c loại thực phẩm h&agrave;ng ng&agrave;y. Ăn nhiều tr&aacute;i c&acirc;y, quả ch&iacute;n, rau xanh để bổ sung những vitamin c&oacute; lợi cho sức khỏe.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"benh-tim-mach\" src=\"http://greenliving.vip/storage/products/April2019/benh-tim-mach-13.png\" alt=\"benh-tim-mach\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Hạn chế sử dụng dầu động vật.</p>\r\n<p>3. &nbsp;&nbsp;&nbsp;Sử dụng dầu thực vật thay thế mỡ động vật, hạn chế c&aacute;c m&oacute;n x&agrave;o, r&aacute;n, tăng cường c&aacute;c m&oacute;n luộc, hấp. Ăn c&aacute; nhiều v&igrave; trong c&aacute;c loại c&aacute; biển c&oacute; chứa nhiều acid b&eacute;o omega-3, omega-6 rất tốt với người mắc bệnh tim mạch. Hạn chế c&aacute;c loại thịt đỏ (thịt b&ograve;, thịt heo), tăng cường c&aacute;c loại thịt trắng (ức g&agrave;, t&ocirc;m, c&aacute;), bổ sung th&ecirc;m c&aacute;c loại thực phẩm gi&agrave;u đạm thực vật như đậu, đỗ, lạc, vừng. C&ugrave;ng với thực đơn khoa học h&agrave;ng ng&agrave;y th&igrave; thực phẩm bổ sung từ sữa l&agrave; sự lựa chọn cho người bệnh tim mạch hoặc c&oacute; nguy cơ mắc bệnh tim mạch như người trung v&agrave; cao tuổi. Đ&acirc;y l&agrave; loại thực phẩm c&oacute; gi&aacute; trị dinh dưỡng cao, tiện lợi v&agrave; dễ sử dụng. C&aacute;c chất đạm của sữa l&agrave; chất đạm c&oacute; gi&aacute; trị sinh học cao, chứa nhiều axit amin cần thiết. Một số một số loại thực phẩm bổ sung c&oacute; th&agrave;nh phần Mufa, Pufa, Omega 3, Omega 6 cũng l&agrave; những axit b&eacute;o gi&uacute;p giảm cholesterol xấu trong cơ thể, ph&ograve;ng xơ vữa động mạch, tốt cho bệnh tim mạch, huyết &aacute;p. Những axit b&eacute;o n&agrave;y cũng c&oacute; vai tr&ograve; rất quan trọng đối với việc x&acirc;y dựng v&agrave; bảo vệ hệ thần kinh. Tuy nhi&ecirc;n, một số người cao tuổi hay bị rối loạn ti&ecirc;u h&oacute;a khi sử dụng c&aacute;c chế phẩm từ sữa b&ograve; n&ecirc;n lựa chọn thực phẩm bổ sung c&oacute; sử dụng nguy&ecirc;n liệu từ đạm đậu n&agrave;nh để vừa ph&ugrave; hợp với nhu cầu dinh dưỡng, vừa kh&ocirc;ng cần phải lo lắng đến t&igrave;nh trạng kh&oacute; chịu của đường ti&ecirc;u h&oacute;a.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\">&nbsp;</p>','products/June2019/JSIZO1mN4Gxc3Hc5Mxgv.gif','3-cach-bo-sung-suc-khoe-cho-benh-nhan-tim-mach',NULL,'Healthy','2019-04-11 07:30:54','2019-06-12 01:40:25',NULL,NULL,NULL,NULL),(29,'Cao Nấm Trùng Thảo Cordy - X có dùng được cho bệnh nhân tim mạch?',6,'Bệnh tim mạch, một loại bệnh mà đòi hỏi bệnh nhân phải đặc biệt chú ý đến chế độ ăn uống hàng ngày cũng như hạn chế rất nhiều thành phần dinh dưỡng để đảm bảo và duy trì sự ổn định cho cơ thể.',NULL,'<p>Bệnh tim mạch, một loại bệnh m&agrave; đ&ograve;i hỏi bệnh nh&acirc;n phải đặc biệt ch&uacute; &yacute; đến chế độ ăn uống h&agrave;ng ng&agrave;y cũng như hạn chế rất nhiều th&agrave;nh phần dinh dưỡng để đảm bảo v&agrave; duy tr&igrave; sự ổn định cho cơ thể. V&igrave; thế, khi cho ra mắt, <a href=\"http://greenliving.vip\">MHD Pharma</a> đ&atilde; nhận được kh&ocirc;ng &iacute;t mối quan t&acirc;m từ kh&aacute;ch h&agrave;ng rằng liệu sản phẩm c&oacute; d&ugrave;ng được cho bệnh nh&acirc;n tim mạch. Để trả lời được c&acirc;u hỏi n&agrave;y, trước ti&ecirc;n ch&uacute;ng ta phải hiểu r&otilde; những vấn đề trong chế độ dinh dưỡng m&agrave; người mắc bệnh về tim mạch cần lưu &yacute; qua b&agrave;i viết dưới đ&acirc;y!</p>\r\n<h3 style=\"margin-top: 1px;\">V&igrave; sao bệnh nh&acirc;n tim mạch n&ecirc;n lưu &yacute; về th&agrave;nh phần dinh dưỡng?</h3>\r\n<p>C&oacute; một sự thật l&agrave; hầu hết những m&oacute;n ăn ch&uacute;ng ta ăn h&agrave;ng ng&agrave;y đều chứa rất nhiều h&agrave;m lượng cholesterol. Việc bổ sung qu&aacute; nhiều sẽ khiến h&agrave;m lượng chất n&agrave;y trong m&aacute;u bị lắng động ở th&agrave;nh mạch g&acirc;y xơ vữa v&agrave; l&agrave; nguy&ecirc;n nh&acirc;n dẫn đến c&aacute;c bệnh l&yacute; tim mạch.</p>\r\n<p>Do đ&oacute;, để ph&ograve;ng tr&aacute;nh cũng như hạn chế sự ph&aacute;t triển của <a href=\"http://greenliving.vip/thong-tin-can-quan-tam?3-cach-bo-sung-suc-khoe-cho-benh-nhan-tim-mach\">bệnh tim mạch</a>, ch&uacute;ng ta cần phải ch&uacute; trọng đến chế độ dinh dưỡng, kh&ocirc;ng ăn những loại đồ ăn nhiều mỡ, nhiều cholesterol để lu&ocirc;n duy tr&igrave; được c&acirc;n nặng hợp l&yacute; v&agrave; huyết &aacute;p ổn định.</p>\r\n<h3 style=\"margin-top: 1px;\">Cao Nấm Tr&ugrave;ng Thảo Cordy-X mang lại lợi &iacute;ch g&igrave; cho bệnh nh&acirc;n tim mạch?</h3>\r\n<p>L&agrave; sản phẩm được d&agrave;y c&ocirc;ng nghi&ecirc;n cứu v&agrave; sản xuất của trường Đại học Thủ Dầu Một, <a href=\"http://greenliving.vip/san-pham\">Cao Nấm Tr&ugrave;ng Thảo Cordy-X</a> được đ&aacute;nh gi&aacute; l&agrave; sản phẩm chất lượng với nhiều c&ocirc;ng dụng bổ &iacute;ch m&agrave; một trong số đ&oacute; l&agrave; tốt cho người mắc bệnh tim mạch.</p>\r\n<p>V&igrave; được kết hợp giữa tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi, Cordy-X hấp thụ đầy đủ những dược chất trong cả 2 loại thảo dược n&agrave;y, bao gồm rất nhiều những th&agrave;nh phần dược liệu ph&ugrave; hợp với bệnh nh&acirc;n c&oacute; vấn đề về tim mạch, như:</p>\r\n<ul>\r\n<li>Mannitol: C&oacute; t&aacute;c dụng l&agrave;m gi&atilde;n nở cơ tim v&agrave; mạch m&aacute;u n&atilde;o, đồng thời gi&uacute;p tăng tuần ho&agrave;n n&atilde;o v&agrave; tim.</li>\r\n<li>Lipoprotein: Hạn chế nguy cơ xơ vữa động mạch.</li>\r\n<li>Adenosine: L&agrave;m giảm Cholesterol v&agrave; mỡ trong cơ thể, gi&uacute;p c&acirc;n bằng qu&aacute; tr&igrave;nh trao đổi chất từ đ&oacute; đảm bảo huyết &aacute;p lu&ocirc;n ở mức b&igrave;nh thường v&agrave; ổn định c&acirc;n nặng.</li>\r\n<li>Germanium: L&agrave; chất gi&uacute;p kh&iacute; huyết lưu th&ocirc;ng v&agrave; c&aacute;c tế b&agrave;o hấp thu Oxy tốt hơn.</li>\r\n</ul>\r\n<p style=\"text-align: right;\"><em><strong>Lee</strong></em></p>','products/June2019/i1QTD93pB6APIFvbYohC.png','cao-nam-trung-thao-cordy-x-co-dung-d-oc-cho-benh-nhan-tim-mach',NULL,'Healthy','2019-04-12 04:51:00','2019-06-12 00:45:01',NULL,'Bệnh tim mạch, một loại bệnh mà đòi hỏi bệnh nhân phải đặc biệt chú ý đến chế độ ăn uống hàng ngày cũng như hạn chế rất nhiều thành phần dinh dưỡng để đảm bảo và duy trì sự ổn định cho cơ thể.','Cao Nấm Trùng Thảo Cordy - X có dùng được cho bệnh nhân tim mạch?','dinh duong'),(30,'Bồi bổ sức khỏe cho bệnh nhân tim mạch với Cao Nấm Trùng Thảo Cordy-X',7,'Luôn được biết đến là sản phẩm rất tốt cho người mắc các bệnh lý về tim mạch nhờ vào những thành phần dinh dưỡng của mình, đông trùng hạ thảo hẳn là cái tên quá quen thuộc với người dùng.',NULL,'<p>Lu&ocirc;n được biết đến l&agrave; sản phẩm rất tốt cho người mắc c&aacute;c bệnh l&yacute; về tim mạch nhờ v&agrave;o những th&agrave;nh phần dinh dưỡng của m&igrave;nh, đ&ocirc;ng tr&ugrave;ng hạ thảo hẳn l&agrave; c&aacute;i t&ecirc;n qu&aacute; quen thuộc với người d&ugrave;ng. Tr&ecirc;n thị trường hiện nay c&oacute; một sản phẩm c&oacute; khả năng bồi bổ, phục hồi sức khỏe, gi&uacute;p ổn định huyết &aacute;p cực kỳ tốt với t&ecirc;n gọi Cao Nấm Tr&ugrave;ng Thảo Cordy-X đến từ c&ocirc;ng ty MHD Pharma.</p>\r\n<p>H&atilde;y c&ugrave;ng t&igrave;m hiểu những l&yacute; do khiến Cao Nấm Tr&ugrave;ng Thảo Cordy-X trở th&agrave;nh sản phẩm được nhiều kh&aacute;ch h&agrave;ng, đặc biệt l&agrave; người mắc bệnh <a href=\"http://greenliving.vip/thong-tin-can-quan-tam?cao-nam-trung-thao-cordy-x-co-dung-d-oc-cho-benh-nhan-tim-mach\">tim mạch</a> ưa chuộng sử dụng qua b&agrave;i viết n&agrave;y nh&eacute;!</p>\r\n<h3 style=\"margin-top: 1px;\">Nguồn gốc v&agrave; quy tr&igrave;nh sản xuất ra Cao Nấm Tr&ugrave;ng Thảo Cordy-X</h3>\r\n<p>Với sứ mệnh v&agrave; mục ti&ecirc;u mang đến cho kh&aacute;ch h&agrave;ng, bệnh nh&acirc;n những sản phẩm đạt chất lượng v&agrave; hiệu quả tốt nhất, năm 2011, trường Đại học Thủ Dầu M&ocirc;t (TDMU) đ&atilde; cho ra đời Cao Nấm Tr&ugrave;ng Thảo Cordy-X &ndash; l&agrave; sự kết hợp của tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave; tinh chất nấm linh chi.</p>\r\n<p>V&agrave; để Cordy-X lu&ocirc;n đạt h&agrave;m lượng dược chất cao nhất, c&aacute;c nh&agrave; khoa học l&agrave; c&aacute;c Ph&oacute; Gi&aacute;o Sư, Tiến Sĩ của trường ĐH Thủ Dầu Một rất ch&uacute; trọng đến từng giai đoạn trong qu&aacute; tr&igrave;nh ph&aacute;t triển v&agrave; h&igrave;nh th&agrave;nh n&ecirc;n sản phẩm của m&igrave;nh. Từ kh&acirc;u tuyển chọn con giống (nhập khẩu con giống từ ATCC &ndash; Ng&acirc;n h&agrave;ng giống uy t&iacute;n v&agrave; lớn nhất thế giới từ Hoa Kỳ) cho đến m&ocirc;i trường nu&ocirc;i trồng (được thiết lập v&ocirc; tr&ugrave;ng th&ocirc;ng qua một hệ thống gi&aacute;m s&aacute;t tự động giống như m&ocirc;i trường sinh trưởng ngo&agrave;i tự nhi&ecirc;n của đ&ocirc;ng tr&ugrave;ng hạ thảo) v&agrave; đặc biệt l&agrave; &aacute;p dụng c&ocirc;ng nghệ chiết xuất hiện đại từ H&agrave;n Quốc gi&uacute;p sản phẩm c&oacute; độ h&ograve;a tan v&agrave; thẩm thấu nhanh.</p>\r\n<p><img title=\"dong-trung-ha-thao-viet-nam\" src=\"http://greenliving.vip/storage/products/April2019/Dong-trung-ha-thao-viet-nam2.png\" alt=\"dong-trung-ha-thao-viet-nam\" width=\"750\" /></p>\r\n<p style=\"text-align: center;\">Cao Nấm Tr&ugrave;ng Thảo Cordy-X l&agrave; sản phẩm Cao Đặc&nbsp;kết hợp giữa&nbsp;tinh chất&nbsp;đ&ocirc;ng tr&ugrave;ng hạ thảo v&agrave;&nbsp;tinh chất nấm linh chi.</p>\r\n<h3 style=\"margin-top: 1px;\">C&ocirc;ng dụng của Cao Nấm Tr&ugrave;ng Thảo Cordy-X với bệnh nh&acirc;n tim mạch</h3>\r\n<p>Như đ&atilde; giải th&iacute;ch ở tr&ecirc;n, <a href=\"http://greenliving.vip/thong-tin-can-quan-tam?song-khoe-n-ngon-cho-benh-nhan-tim-mach\">Cordy-X</a> được tạo ra nhờ v&agrave;o sự kết hợp của tinh chất nấm linh chi v&agrave; tinh chất đ&ocirc;ng tr&ugrave;ng hạ thảo n&ecirc;n sản phẩm mang lại rất nhiều dược chất c&oacute; lợi cho việc bồi bồ sức khỏe của người sử dụng, nhất l&agrave; với người mắc bệnh tim mạch:</p>\r\n<ul>\r\n<li>Kiểm so&aacute;t cholesterol v&agrave; c&aacute;c chất b&eacute;o trong m&aacute;u, gi&uacute;p kiểm so&aacute;t huyết &aacute;p tốt hơn, hạn chế những cơn tăng &aacute;p đột ngột &ndash; nguy cơ dẫn đến đột quỵ, tử vong.</li>\r\n<li>Gi&uacute;p hoạt huyết v&agrave; chống xơ vữa động mạch, ph&ograve;ng tr&aacute;nh những cơn đau tim hay c&aacute;c bệnh l&yacute; li&ecirc;n quan đến tim mạch.</li>\r\n<li>Gi&uacute;p cơ thể tăng lưu lượng m&aacute;u đến cơ quan tạng phủ, từ đ&oacute; dễ d&agrave;ng bồi bổ v&agrave; bảo vệ cơ thể khi suy nhược</li>\r\n<li>Tăng khả năng thực b&agrave;o của Bạch Cầu nhằm tăng sức đề kh&aacute;ng.</li>\r\n</ul>','products/June2019/iod0BKcD3WprsTeYTGGi.png','boi-bo-suc-khoe-cho-benh-nhan-tim-mach-voi-cao-nam-trung-thao-cordy-x',NULL,'Healthy','2019-04-12 05:05:18','2019-06-12 00:59:45',NULL,'Luôn được biết đến là sản phẩm rất tốt cho người mắc các bệnh lý về tim mạch nhờ vào những thành phần dinh dưỡng của mình, đông trùng hạ thảo hẳn là cái tên quá quen thuộc với người dùng.','bồi bổ','Bồi bổ sức khỏe cho bệnh nhân tim mạch với Cao Nấm Trùng Thảo Cordy-X'),(31,'Kid Grow Care',2,'Kid Grow Care',NULL,'<p>Kid Grow Care</p>','products/June2019/tJaCM7f8H8XZGZLtKYho.jpg','kid-grow-care','2000000',NULL,'2019-06-27 20:37:33','2019-06-27 20:37:33',NULL,NULL,NULL,NULL),(32,'Blood Tonic Care',2,'Blood Tonic Care',NULL,'<p>Blood Tonic Care</p>','products/June2019/CW2IsDvOYnDrPIwrIjBB.jpg','blood-tonic-care','2000000',NULL,'2019-06-27 20:38:00','2019-06-27 20:38:00',NULL,NULL,NULL,NULL),(33,'Digesty Care',2,'Digesty Care',NULL,'<p>Digesty Care</p>','products/June2019/emywp2tbIcIXe7Fqt9Mm.jpg','digesty-care',NULL,'Digesty Care','2019-06-27 20:38:26','2019-06-27 20:38:26',NULL,NULL,NULL,NULL),(34,'Nano Heal',2,'Nano Heal',NULL,'<p>Nano Heal</p>','products/June2019/oibSv2L4PovjcTUFb6eg.jpg','nano-heal','2000000',NULL,'2019-06-27 20:39:19','2019-06-27 20:39:26',NULL,NULL,NULL,NULL);
